 z+="*    return { success: 'ok' }\xFE";
 z+="* end function\xFE";
 z+="*\xFE";
 z+="*\xFE";
 z+="* jsSucces alternative toappend html:\xFE";
 z+="*      jsSuccess = ` \xFE";
 z+="*         var a = json.items;\xFE";
 z+="*         for (index = 0; index < a.length; ++index) {\xFE";
