 z+="*             $(window.activeFolder).children('ul').append(html);\xFE";
 z+="*         }\xFE";
 z+="*         `\xFE";
 z+="*\xFE";
 z+="* To use in genEventHandler, use id 11\xFE";
 z+="*\xFE";
 z+="*   Print @genEventHandler(\"SelectEmptyFolder\", \"\", 11, @AJax(QuotedUrl, jsSuccess)):\xFE";
 z+="*\xFE";
 z+="function ajax(ByVal QuotedUrl As String, Optional ByVal jsSuccess As String, Optional ByVal jsFailure As String, Optional ByVal PostPayLoad As String, Optional ByVal infoMsg As String, Optional ByVal HeaderJSON As JSON, Optional ByVal Ok2Cache) As String\xFE";
 z+="    * $option async- // build this as an internal javascript funciton\xFE";
 z+="    Dim JS As String\xFE";
 z+="\xFE";
 z+="    if !jsFailure then \xFE";
 z+="        jsFailure = `\xFE";
 z+="            if ( window.doDebug ) debugger;\xFE";
 z+="            if (textStatus == 'parsererror') {\xFE";
 z+="                new popoutWindow('AJAX call error, Expected JSON result', `:QuotedUrl:`, \"80%\", \"auto\");\xFE";
 z+="            } else if (errorThrown) {\xFE";
 z+="               alert(errorThrown); \xFE";
 z+="            } else {\xFE";
