window.cached_jsb_bf["alert"]="function Alert(Byval Msg As String, Optional ByVal Modal As Boolean)\xFE    * $options gae, aspx, aspxc-\xFE    Dim Ans As String\xFE    \xFE    If isMissing(Modal) Then Modal = True\xFE    \xFE    If @IsAdmin() Then\xFE        Ans = @Jsb_bf.MsgBox(\"Alert\", Msg, \"OK,Debug\")\xFE        If Ans = \"Debug\" Then Debug\xFE        Return \"OK\"\xFE    End If\xFE    \xFE    Return @Jsb_bf.MsgBox(\"Alert\", Msg, \"OK\")\xFEEnd function\xFE";
var z="// Create a jsb meta definition from the given array of json\xFE";
 z+="function analyseJson(ByVal jsArray As Array, ByRef PrimaryKeyName As String, ByVal forceAllowNulls As Boolean) As Array\xFE";
 z+="    Dim RESULTS As Array\xFE";
 z+="    Dim FIRSTONE As Boolean\xFE";
 z+="    Dim ALLDEFINED As Boolean\xFE";
 z+="    Dim PTIME As Boolean\xFE";
 z+="    Dim PDATE As Boolean\xFE";
 z+="    Dim COUNTER As Integer\xFE";
 z+="    Dim CC As Integer\xFE";
 z+="    Dim I As Integer\xFE";
 z+="    Dim ORDINAL As Integer\xFE";
 z+="    Dim BIGGEST As Integer\xFE";
 z+="    Dim COLUMNDEFS As Json\xFE";
 z+="    Dim CDEF As Json\xFE";
 z+="    Dim JSONITEM As Json\xFE";
 z+="    Dim TN As String\xFE";
 z+="    Dim TT As String\xFE";
 z+="    Dim FIRSTREC As StRiNg\xFE";
 z+="    Dim V As StriNg\xFE";
 z+="\xFE";
 z+="    ColumnDefs = {}\xFE";
 z+="    \xFE";
 z+="    firstOne = !PrimaryKeyName\xFE";
 z+="    firstRec = Null\xFE";
 z+="    \xFE";
 z+="    For Each jSonItem, Counter In jsArray\xFE";
 z+="        AllDefined = False ;* Need To Process All Records So We Can Get Max String Lengths\xFE";
 z+="        If !firstRec Then firstRec = jSonItem\xFE";
 z+="        ItemID = jSonItem.ItemID\xFE";
 z+="        \xFE";
 z+="        For Each Tn, ordinal In jSonItem\xFE";
 z+="            if Tn <> \"ItemID\" Then\xFE";
 z+="                cDEF = ColumnDefs[Tn]\xFE";
 z+="                If !cDEF Then\xFE";
 z+="                    ColumnDefs[Tn] = {}\xFE";
 z+="                    cDEF = ColumnDefs[Tn]\xFE";
 z+="                    cDEF.name = Tn\xFE";
 z+="                    cDEF.required = True\xFE";
 z+="                    cDEF.notblank = True\xFE";
 z+="                    cDef.ordinal = ordinal\xFE";
 z+="                End If\xFE";
 z+="                \xFE";
 z+="                V = jSonItem[Tn]\xFE";
 z+="                If LCase(Tn) = LCase(PrimaryKeyName) Or (firstOne And V = ItemID) Then\xFE";
 z+="                    PrimaryKeyName = Tn\xFE";
 z+="                    cDEF.primarykey = True\xFE";
 z+="                    firstOne = False\xFE";
 z+="                End If\xFE";
 z+="                \xFE";
 z+="                // Possible data types: guid, autointeger, integer, double, boolean, string, date, time, datetime, currency, blob, png, jpg, collection, memo, password, jsonarray, jsonrow \xFE";
 z+="                If isNull(V) Then \xFE";
 z+="                    Remove cDEF, \"required\"\xFE";
 z+="                    Remove cDEF, \"notblank\"\xFE";
 z+="                Else\xFE";
 z+="                    If CStr(Val(V)) = V Then V = Val(V)\xFE";
 z+="                    If Len(V) = 0 Then Remove cDEF, \"notblank\"\xFE";
 z+="                End If\xFE";
 z+="                \xFE";
 z+="                Select Case TypeOf(V)\xFE";
 z+="                    Case \"Null\"\xFE";
 z+="                        \xFE";
 z+="                    Case \"String\"\xFE";
 z+="                        // Could be date, time, or datetime, or guid\xFE";
 z+="                        If Len(V) And cDEF.datatype <> \"string\" Then\xFE";
 z+="                            \xFE";
 z+="                            // Does V look like a time? 2018-05-02T18:01:53-06:00 \xFE";
 z+="                            Tt = DropIfLeft(V, \"T\")\xFE";
 z+="                            if InStr(Tt, \" \") Then TT = Field(TT, \" \", 2)\xFE";
 z+="                            Cc = Count(Tt, \":\")\xFE";
 z+="                            If Cc = 2 Or Cc = 3 Then\xFE";
 z+="                                pTime = Val(Field(Tt, \":\", 1)) <= 24 And Len(Field(Tt, \":\", 1)) > 0 And Val(Field(Tt, \":\", 2)) <= 59 And Len(Field(Tt, \":\", 2)) > 0 And Val(Field(Tt, \":\", 3)) <= 59 And Len(Field(Tt, \":\", 3)) > 0\xFE";
 z+="                            Else\xFE";
 z+="                                pTime = False\xFE";
 z+="                            End If\xFE";
 z+="                            \xFE";
 z+="                            // Does V look like a date?\xFE";
 z+="                            If Count(V, \"/\") = 2 Then\xFE";
 z+="                                // day/month/year\xFE";
 z+="                                // pDate = Val(Field(V, \"/\", 1)) >= 1 And Val(Field(V, \"/\", 2)) >= 1 And Val(Field(V, \"/\", 2)) <=12 And Val(Field(V, \"/\", 3)) >= 1\xFE";
 z+="                                \xFE";
 z+="                                // month/day/year\xFE";
 z+="                                pDate = Val(Field(V, \"/\", 1)) >= 1 And Val(Field(V, \"/\", 2)) >= 1 And Val(Field(V, \"/\", 1)) <= 12 And Val(Field(V, \"/\", 3)) >= 1\xFE";
 z+="                                \xFE";
 z+="                            Else If Count(V, \"-\") = 2 Then\xFE";
 z+="                                // month-day-year\xFE";
 z+="                                pDate = Val(Field(V, \"-\", 1)) >= 1 And Val(Field(V, \"-\", 2)) >= 1 And Val(Field(V, \"-\", 2)) <=12 And Val(Field(V, \"-\", 3)) >= 1\xFE";
 z+="                                \xFE";
 z+="                            Else If Count(V, \"-\") = 3 And pTime Then\xFE";
 z+="                                pDate = Val(Field(V, \"-\", 1)) >= 1 And Val(Field(V, \"-\", 2)) >= 1 And Val(Field(V, \"-\", 2)) <=12 And Val(Field(V, \"-\", 3)) >= 1\xFE";
 z+="                            Else\xFE";
 z+="                                pDate = False\xFE";
 z+="                            End If\xFE";
 z+="                            \xFE";
 z+="                            // guess datatype\xFE";
 z+="                            previousDT = cDEF.datatype \xFE";
 z+="                            If pTime And Len(V) <= 13 Then\xFE";
 z+="                                cDEF.datatype = \"time\"\xFE";
 z+="                                \xFE";
 z+="                            ElseIf pDate And Len(V) <= 12 Then\xFE";
 z+="                                cDEF.datatype = \"date\"\xFE";
 z+="                                \xFE";
 z+="                            ElseIf pDate And pTime And Len(V) <= 28 Then\xFE";
 z+="                                cDEF.datatype = \"datetime\"\xFE";
 z+="                                \xFE";
 z+="                            ElseIf Left(V, 1) = \"$\" And IsNumeric(Mid(V, 2)) Then\xFE";
 z+="                                cDEF.datatype = \"currency\"\xFE";
 z+="                                \xFE";
 z+="                            ElseIf LCase(V) = \"true\" Or LCase(V) = \"false\" Then\xFE";
 z+="                                cDEF.datatype = \"boolean\"\xFE";
