var z="function buildValue(ByVal forSqlServer As Boolean, ByVal cDEF As JSON, byval cValue As Variant) As StriNg\xFE";
 z+="    * $options aspxc-\xFE";
 z+="    Dim DATATYPE As StRiNg\xFE";
 z+="\xFE";
 z+="   dataType = cDEF.datatype\xFE";
 z+="   If isNull(cValue) Then\xFE";
 z+="        if cDEF.primarykey And forSqlServer then\xFE";
 z+="            // SQL Server does not allow null primary keys\xFE";
 z+="            If dataType = \"datetime\" Or dataType = \"date\" Or dataType = \"time\" Then\xFE";
 z+="                Return \"'12/30/1899  12:00:00 AM'\"\xFE";
 z+="                \xFE";
 z+="            ElseIf dataType = \"boolean\" Then\xFE";
 z+="                Return \"false\"\xFE";
 z+="    \xFE";
 z+="            ElseIf dataType = \"guid\" Then\xFE";
 z+="                Return \"'0000000-0000-0000-0000-000000000000'\"\xFE";
 z+="    \xFE";
 z+="            ElseIf dataType = \"autointeger\" Or dataType = \"integer\" Or dataType = \"double\" Or dataType = \"currency\" Then\xFE";
 z+="                Return \"0\"\xFE";
 z+="            Else\xFE";
 z+="                Return \"''\"\xFE";
 z+="            End If\xFE";
 z+="        Else\xFE";
 z+="            Return \"NULL\"\xFE";
 z+="        End if\xFE";
 z+="\xFE";
 z+="    ElseIf dataType = \"datetime\" Or dataType = \"date\" Or dataType = \"time\" Then\xFE";
 z+="        If Left(cValue, 11) = \"12/30/1899 \" Then cValue = Mid(cValue, 12)\xFE";
 z+="        cValue = Replace(cValue, \" 12:00:00 AM\", \"\")\xFE";
 z+="        If cValue Or cDEF.required Then\xFE";
 z+="            If forSqlServer Then cValue = \"'\" : cValue : \"'\" Else cValue = \"#\" : cValue : \"#\"\xFE";
 z+="        Else\xFE";
 z+="            cValue = \"NULL\"\xFE";
 z+="        End If\xFE";
 z+="        Return cValue\xFE";
 z+="\xFE";
 z+="    ElseIf dataType = \"boolean\" Then\xFE";
 z+="        Return Val(cValue)\xFE";
 z+="\xFE";
 z+="    ElseIf dataType = \"guid\" Then\xFE";
 z+="        Return \"'\" : CStr(cValue) : \"'\"\xFE";
 z+="\xFE";
 z+="    ElseIf dataType = \"autointeger\" Or dataType = \"integer\" Or dataType = \"double\" Or dataType = \"currency\" Then\xFE";
 z+="        If cValue = \"\" Then \xFE";
 z+="            If cDEF.required Then cValue = \"0\" ELse cValue = \"NULL\"\xFE";
 z+="        End If\xFE";
 z+="        \xFE";
 z+="        Return cValue\xFE";
 z+="        \xFE";
 z+="    ElseIf Len(cValue) = 0 And !cDEF.required and !cDEF.primarykey Then\xFE";
 z+="        Return \"NULL\"\xFE";
 z+="        \xFE";
 z+="    ElseIf dataType = \"blob\" Or dataType = \"png\" Or dataType = \"jpg\" Then\xFE";
 z+="        if Len(cValue) = 0 Then\xFE";
 z+="            Return \"''\"\xFE";
 z+="        Else\xFE";
 z+="            Return `CONVERT(varbinary(max), '0x`:Stx(cValue):`', 1)` // convert binary back to hex with Convert(varchar(max), binary, 2)\xFE";
 z+="        End If\xFE";
 z+="        \xFE";
 z+="    Else\xFE";
 z+="        cValue = \"'\" : Replace(cValue, \"'\", \"''\") : \"'\"\xFE";
 z+="        cValue = Replace(cValue, Crlf(), \"' + CHAR(13)+CHAR(10) + '\")\xFE";
 z+="        cValue = Replace(cValue, Cr(), \"' + CHAR(13) + '\")\xFE";
 z+="        cValue = Replace(cValue, Lf(), \"' + CHAR(10) + '\")\xFE";
 z+="\xFE";
 z+="        Return cValue\xFE";
 z+="    End If\xFE";
 z+="end function"
