 z+="* $option async-, aspxc- // build this as an internal javascript funciton\xFE";
 z+="    Dim I As Integer\xFE";
 z+="    Dim SSRC As String\xFE";
 z+="    Dim S As Variable\xFE";
 z+="\xFE";
 z+="    S = Change(Src, CHR(226):CHR(128):CHR(152), \"'\")\xFE";
 z+="    S = Change(S, CHR(226):CHR(128):CHR(153), \"'\")\xFE";
 z+="    S = Change(S, CHR(239):CHR(191):CHR(189), Chr(253))\xFE";
 z+="    S = Change(S, Chr(226):chr(140):Chr(137), Chr(253))    \xFE";
 z+="    S = Change(S, Chr(160), Chr(32)) ;' non breaking space\xFE";
 z+="    S = Change(S, Chr(9), Chr(32))\xFE";
 z+="    S = Change(S, Chr(28), \"\")\xFE";
 z+="    S = Change(S, Chr(29), \"\")\xFE";
 z+="\xFE";
 z+="    if !noCrlf then\xFE";
 z+="        S = Change(S, Crlf(), Am())\xFE";
 z+="        S = Change(S, Cr(), Am())\xFE";
 z+="        S = Change(S, Lf(), Am())\xFE";
