 z+="        S = Change(S, Chr(255), Am())\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    S = Change(S, Chr(145), Chr(39))\xFE";
 z+="    S = Change(S, Chr(146), Chr(39))    \xFE";
 z+="    \xFE";
 z+="    S = Change(S, Chr(147), Chr(34))\xFE";
