 z+="//\xFE";
 z+="\xFE";
 z+="// Convert datatype to one of: guid;autointeger;integer;double;boolean;string;date;time;datetime;currency;blob;png;jpg;collection;url;memo;password,jsonarray,jsonrow\xFE";
 z+="function ColumnDef2JSB(ByVal columnDef As JSON) As Json\xFE";
 z+="    Dim JSB As Json\xFE";
 z+="    Dim LABEL As String\xFE";
 z+="    Dim DFT As String\xFE";
 z+="    Dim DATATYPE As String\xFE";
 z+="\xFE";
 z+="    // ColumnDef Fields from SqLite: ColumnName, DataType, AllowDBNull, AutoIncrement, AutoIncrementSeed, AutoIncrementStep, Caption, DefaultValue, MaxLength, ordinal, Namespace, Prefix, ReadOnly, Unique, PrimaryKey\xFE";
 z+="    \xFE";
 z+="    Jsb = { }\xFE";
 z+="    Jsb.name = columnDef.ColumnName\xFE";
 z+="    \xFE";
 z+="    Label = columnDef.Caption\xFE";
 z+="    If LCase(Label) = Label Or UCase(Label) = Label Then Label = UCase(Left(Label, 1)):LCase(Mid(Label, 2))\xFE";
 z+="    Jsb.label = Trim(Replace(Label, \"_\", \" \"))\xFE";
 z+="\xFE";
 z+="    If columnDef.PrimaryKey Then Jsb.primarykey = columnDef.PrimaryKey\xFE";
 z+="    Jsb.datatype = \"string\" ;* Guid;Autointeger;Integer;Double;Boolean;String;Date;Time;Datetime;Currency;Blob;Png;Jpg;Collection;Url;Memo;Password,Jsonarray,Jsonrow\xFE";
 z+="    Jsb.sortable = True\xFE";
 z+="    If !columnDef.AllowDBNull Then \xFE";
 z+="        Jsb.required = True\xFE";
