 z+="    End If\xFE";
 z+="\xFE";
 z+="    Jsb.canedit = !columnDef.ReadOnly\xFE";
 z+="    if hastag(columnDef, \"Ordinal\") then Jsb.ordinal = columnDef.Ordinal\xFE";
 z+="    if hastag(columnDef, \"ordinal\") then Jsb.ordinal = columnDef.ordinal\xFE";
 z+="    \xFE";
 z+="    If columnDef.MaxLength > 0 Then Jsb.maxlength = columnDef.MaxLength\xFE";
 z+="    If columnDef.Unique = \"true\" Then Jsb.unique = columnDef.unique\xFE";
 z+="    \xFE";
 z+="    // Convert datatype to one of: guid;autointeger;integer;double;boolean;string;date;time;datetime;currency;blob;png;jpg;collection;url;memo;password,jsonarray,jsonrow\xFE";
 z+="    \xFE";
 z+="    dataType = LCase(columnDef.DATA_TYPE)\xFE";
 z+="    If !dataType Then dataType = LCase(columnDef.DataType)\xFE";
 z+="    If !dataType Then dataType = LCase(columnDef.datatype)\xFE";
 z+="    \xFE";
 z+="    If Instr(dataType, \"[\") Then dataType = Field(dataType, \"[\", 1):\"[]\"\xFE";
 z+="    If Left(dataType, 7) = \"system.\" Then\xFE";
 z+="        Select Case Field(dataType, \".\", 2)\xFE";
 z+="            Case \"boolean\": Jsb.datatype = \"boolean\"\xFE";
 z+="            Case \"byte\": Jsb.datatype = \"integer\"\xFE";
 z+="            Case \"int16\": Jsb.datatype = \"integer\"\xFE";
 z+="            Case \"int32\": Jsb.datatype = \"integer\"\xFE";
