 z+="        \xFE";
 z+="        Select Case dataType\xFE";
 z+="            Case \"bigint\": Jsb.datatype = \"integer\" ;* A 64-Bit Signed Integer.\xFE";
 z+="            Case \"binary\": Jsb.datatype = \"blob\" ;* Array Of Type Byte Upto 8K\xFE";
 z+="            Case \"bit\": Jsb.datatype = \"boolean\" ;* 0, 1, Or Nothing.\xFE";
 z+="            Case \"char\": Jsb.datatype = \"string\" ;* Fixed Length String Up To 8K\xFE";
 z+="            Case \"date\": Jsb.datatype = \"date\"\xFE";
 z+="            Case \"datetime\": Jsb.datatype = \"datetime\" ;* Accuracy Of 3.33 Milliseconds\xFE";
 z+="            Case \"datetime2\": Jsb.datatype = \"datetime\" ;* 100 Nanoseconds Accuracy\xFE";
 z+="            Case \"datetimeoffset\": Jsb.datatype = \"datetime\" ;* With Timezone\xFE";
 z+="            Case \"decimal\": Jsb.datatype = \"double\" ;* A Fixed Precision And Scale\xFE";
 z+="            Case \"float\": Jsb.datatype = \"double\"   ;* Floating Precision\xFE";
 z+="            Case \"image\": Jsb.datatype = \"jpg\" ;* Array Of Type Byte. (Could Be Png Or Other)\xFE";
 z+="            Case \"int\": Jsb.datatype = \"integer\" ;* A 32-Bit Signed Integer\xFE";
 z+="            Case \"money\": Jsb.datatype = \"currency\" ;* ;* A Fixed Precision And Scale\xFE";
 z+="            Case \"nchar\": Jsb.datatype = \"string\" ;* Fixed Length Unicode String Up To 8K\xFE";
 z+="            Case \"ntext\": Jsb.datatype = \"string\" ;* Variable Length Unicode Up To  8Gb\xFE";
 z+="            Case \"nvarchar\": Jsb.datatype = \"string\" ;* Variable Length Unicode Upto 4K\xFE";
 z+="            Case \"real\": Jsb.datatype = \"double\"\xFE";
 z+="            Case \"smalldatetime\": Jsb.datatype = \"time\"\xFE";
 z+="            Case \"smallint\": Jsb.datatype = \"integer\"\xFE";
 z+="            Case \"smallmoney\": Jsb.datatype = \"currency\"\xFE";
 z+="            Case \"text\": Jsb.datatype = \"memo\" ;* Non Unicode Upto 4Gb\xFE";
 z+="            Case \"time\": Jsb.datatype = \"time\"\xFE";
 z+="            Case \"timestamp\": Jsb.datatype = \"blob\" ;* Array Of 8 Bytes Unique Within Database\xFE";
 z+="            Case \"tinyint\": Jsb.datatype = \"integer\"\xFE";
 z+="            Case \"uniqueidentifier\": Jsb.datatype = \"guid\"\xFE";
 z+="            Case \"varbinary\": Jsb.datatype = \"blob\" ;* Array Of Byte\xFE";
 z+="            Case \"varchar\": Jsb.datatype = \"string\" ;* String\xFE";
 z+="            Case \"xml\": Jsb.datatype = \"string\"\xFE";
 z+="        End Select\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    If columnDef.AutoIncrement Then Jsb.datatype = \"autointeger\"; Jsb.canedit = False\xFE";
