 z+="    \xFE";
 z+="    If Jsb.datatype = \"blob\" Or Jsb.datatype = \"png\" Or Jsb.datatype = \"img\" Or Jsb.datatype = \"guid\" Or Jsb.datatype = \"memo\" Or Jsb.datatype = \"collection\" Or Jsb.datatype = \"jsonarray\" Or Jsb.datatype = \"jsonrow\" Then\xFE";
 z+="        Jsb.sortable = False\xFE";
 z+="        If Jsb.datatype = \"blob\" Or Jsb.datatype = \"png\" Or Jsb.datatype = \"img\" Or Jsb.datatype = \"guid\" Then Jsb.canedit = False\xFE";
