 z+="    me.hasDeviceOrientation = function () { return 'ondeviceorientation' in window }\xFE";
 z+="    \xFE";
 z+="    if !me.hasAbsoluteOrientation() And !me.hasDeviceOrientation() Then @Errors = \"No DeviceOrientationEvent\"; Return Null\xFE";
 z+="    \xFE";
 z+="    if callBackIName Then\xFE";
 z+="        if !callBackFName Then callBackFName = System(33)\xFE";
 z+="        me.compassHeadingCallBackFName = callBackFName\xFE";
 z+="        me.compassHeadingCallBackIName = callBackIName\xFE";
 z+="        me.doCallBacks = true\xFE";
 z+="        me.DontClearMe = true\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    me.Alpha = undefined\xFE";
 z+="    me.Beta = undefined\xFE";
 z+="    me.Gamma = undefined\xFE";
 z+="    me.firstEvent = true\xFE";
 z+="    me.nested = 0\xFE";
 z+="    \xFE";
 z+="    me.handleCompassChange = function (event) {\xFE";
 z+="        if (me.nested) return;\xFE";
 z+="        me.nested += 1;\xFE";
 z+="        \xFE";
 z+="        if (event.absolute) {\xFE";
 z+="            // nothing to do\xFE";
 z+="        } else if (event.hasOwnProperty('webkitCompassHeading')) {\xFE";
 z+="            // get absolute orientation for Safari/iOS\xFE";
 z+="            event.alpha = 360 - event.webkitCompassHeading;\xFE";
 z+="        } else {\xFE";
 z+="            event.alpha = undefined;\xFE";
 z+="        }\xFE";
 z+="        \xFE";
 z+="        if (event.alpha == null) {\xFE";
 z+="            me.doCallBacks = false;\xFE";
 z+="            At_Errors = 'No Compass Heading in device orientaton';\xFE";
 z+="        }\xFE";
 z+="        \xFE";
 z+="        // One time event?\xFE";
 z+="        if (!me.doCallBacks) {\xFE";
 z+="           // one time event\xFE";
 z+="           window.removeEventListener('deviceorientationabsolute', me.handleCompassChange);\xFE";
 z+="           window.removeEventListener('ondeviceorientation', me.handleCompassChange);\xFE";
 z+="           me.handleCompassChange = undefined;\xFE";
 z+="        }\xFE";
 z+="        \xFE";
 z+="        me.myEvent = event;\xFE";
 z+="        if (me.firstEvent) {\xFE";
 z+="           me._activeProcess.unblock(setBlock_compassReading)\xFE";
 z+="           me.firstEvent = false;\xFE";
 z+="           return\xFE";
 z+="        }\xFE";
 z+="          \xFE";
 z+="         \xFE";
 z+="        jsbCall(me.compassHeadingCallBackFName, me.compassHeadingCallBackIName, function (continueEvents) { \xFE";
 z+="            if (!continueEvents) {\xFE";
 z+="                window.removeEventListener('deviceorientationabsolute', me.handleCompassChange);\xFE";
 z+="                window.removeEventListener('ondeviceorientation', me.handleCompassChange);\xFE";
 z+="                me.handleCompassChange = undefined;\xFE";
 z+="            }\xFE";
 z+="            me.nested -= 1;\xFE";
 z+="        }, me.myEvent);\xFE";
 z+="    }\xFE";
 z+="\xFE";
 z+="    javascript { me._activeProcess.setBlock(setBlock_compassReading, me, \"GOTFIRSTEVENT\") }\xFE";
 z+="    if me.hasAbsoluteOrientation() then\xFE";
 z+="        window.addEventListener('deviceorientationabsolute', me.handleCompassChange);\xFE";
 z+="    else \xFE";
 z+="        window.addEventListener('deviceorientation', me.handleCompassChange);\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    // Exit here and come back when we have the 1st event\xFE";
 z+="    \xFE";
 z+="    javascript { return }\xFE";
 z+="    \xFE";
 z+="GOTFIRSTEVENT:\xFE";
 z+="    me.nested -= 1\xFE";
 z+="    \xFE";
 z+="    return me.myEvent\xFE";
 z+="end function"
