window.cached_jsb_bf["dataadditionalattributes"]="// When an HTML \"control\" has two html elements, one for the UI, and one for processing (data element)\xFE// remove the style attributes used in the UI from the data element\xFE\xFEfunction dataAdditionalAttributes(ByVal oAdditionalAttributes As Object) As String\xFE    * $options async-\xFE\xFE    Dim additionalAttributes As Array = @MergeAttribute(\"\", \"\", \" \", oAdditionalAttributes)\xFE    Dim uiElements As Array = [\"class\", \"style\", \"on\", \"placeholder\"]\xFE    Dim Result As Array = []\xFE\xFE    For Each Atr As String In additionalAttributes\xFE        Dim F1 As String = Field(Atr, \"=\", 1)\xFE        If Left(F1, 2) = \"on\" Then F1 = \"on\"\xFE        Locate F1 In uiElements ELSE Result[-1] = Atr\xFE    Next\xFE    Return Join(Result, ' ')\xFEEnd function";
