 z+="function execInsert(AutoIncrementingWasOn, tableName, cmds)\xFE";
 z+="    * $options aspx, aspxC-\xFE";
 z+="    \xFE";
 z+="    oneAtATime = len(cmds) = 1\xFE";
 z+="    \xFE";
 z+="    Sql = []\xFE";
 z+="    Sql[-1] = \"ALTER TABLE [\" : tableName : \"] NOCHECK CONSTRAINT ALL;\"\xFE";
 z+="    If AutoIncrementingWasOn Then Sql[-1] = \"Set IDENTITY_INSERT [\" : tableName : \"] ON;\" : Crlf()\xFE";
 z+="    \xFE";
 z+="    for each cmd in cmds\xFE";
 z+="        Sql[-1] = Cmd\xFE";
 z+="    next\xFE";
 z+="    \xFE";
 z+="    If AutoIncrementingWasOn Then Sql[-1] = \"Set IDENTITY_INSERT [\" : tableName : \"] OFF;\" : Crlf()\xFE";
 z+="    Sql[-1] = \"ALTER TABLE [\" : tableName : \"] CHECK CONSTRAINT ALL;\"\xFE";
 z+="\xFE";
 z+="    On Error Goto errOut\xFE";
 z+="    X = Sql(Join(Sql, Crlf()))\xFE";
 z+="    Return True\xFE";
 z+="    \xFE";
 z+="errOut: \xFE";
