 z+="// ColumnDefs is the JSON record from Schema(tableName)\xFE";
 z+="function dbCreateTable(Byval tableName As String, Byval ColumnDefs As JSON, Byval forceAllowNulls As Boolean) As Boolean\xFE";
 z+="    * $options aspxc-, aspx\xFE";
 z+="    \xFE";
 z+="    Dim PKS As Array\xFE";
 z+="    Dim ISSQLITE As Boolean\xFE";
 z+="    Dim ONEPRIMARYKEY As Boolean\xFE";
 z+="    Dim ISMSACCESS As Boolean\xFE";
 z+="    Dim COLUMNI As Integer\xFE";
 z+="    Dim CDEF As Json\xFE";
 z+="    Dim ISMSSQL As Boolean\xFE";
 z+="    Dim ISFILESYSTEM As Boolean\xFE";
 z+="    Dim COLUMNNAME As String\xFE";
 z+="    Dim CMD As String\xFE";
 z+="\xFE";
 z+="    If !tableName Or !ColumnDefs Then @Errors = \"No definition for table \":tableName; Return False\xFE";
 z+="    \xFE";
 z+="    // name, label, defaultvalue, required, notblank, tooltip, align, sortable, datatype, primarykey, encrypt, ordinal, canedit, maxlength (for strings), unique\xFE";
 z+="    Select Case UCase(typeOfConnection())\xFE";
 z+="        Case \"MSSQL\": isMSSQL = True\xFE";
 z+="        Case \"ACCESS\": isMSAccess = True\xFE";
 z+="        Case \"FILESYSTEM\": isFileSystem = True\xFE";
 z+="        Case Else\xFE";
 z+="            isSqLite = True\xFE";
 z+="    End Select\xFE";
 z+="    \xFE";
 z+="    PKs = []\xFE";
 z+="    arrayOfDefs = isArray(ColumnDefs)\xFE";
 z+="    For Each column In ColumnDefs\xFE";
 z+="        if arrayOfDefs Then cDEF = column else cDEF = ColumnDefs[column]\xFE";
 z+="        columnName = cDEF.name\xFE";
 z+="        If cDEF.primarykey Then PKs[-1] = \"[\" : columnName : \"]\"\xFE";
 z+="    Next\xFE";
