 z+="    \xFE";
 z+="    On Error Goto errOut\xFE";
 z+="    @Errors = Sql(Cmd)\xFE";
 z+="    Return @Errors = \"\"\xFE";
 z+="    \xFE";
 z+="errOut: \xFE";
 z+="    @Errors = @Errors:crlf():Cmd\xFE";
 z+="    \xFE";
 z+="    Return False\xFE";
 z+="End function"
