var z="\xFE";
 z+="function dbGetDatabaseNames(optional byval serverName, optional byval withPermissions As Boolean) As Array\xFE";
 z+="    * $options aspx\xFE";
 z+="\xFE";
 z+="    if isMissing(ServerName) Then ServerNmame = \"databaseBuilder_ro\"\xFE";
 z+="    \xFE";
 z+="    Dim attachedDB As String = @Session.AttachedDatabase\xFE";
 z+="    Dim sucessfulSelect As Boolean = False\xFE";
 z+="    Dim SL As SelectList\xFE";
 z+="    Dim Cmd As String = `SELECT name FROM sys.databases Where Not name In ('master', 'tempdb', 'model', 'msdb', 'MSys', 'sysdiagrams') And state_desc!='OFFLINE' Order By name`\xFE";
 z+="    \xFE";
 z+="    if serverName Then\xFE";
 z+="        Attachdb serverName Else serverName = \"\"\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    if @Session.AttachedDatabase Then\xFE";
 z+="        Try\xFE";
 z+="            Sqlselect Cmd To Sl Then sucessfulSelect = true\xFE";
 z+="        End Try\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    if sucessfulSelect Then\xFE";
 z+="        Dim Recs As Array = Getlist(Sl)\xFE";
 z+="        Dim databaseNames As Array = []\xFE";
 z+="        For Each Rec As Json In Recs\xFE";
 z+="            databaseName = Rec.name\xFE";
 z+="            if withPermissions Then\xFE";
 z+="                // Make sure we can query the table names Or The viewNames\xFE";
 z+="                Try\xFE";
 z+="                   Dim Sql As String = `use [`:databaseName:`]; SELECT top 3 table_name FROM information_schema.tables WHERE table_type = 'base table'  Order By table_name`\xFE";
 z+="                   Sqlselect Sql To Sl Then databaseNames[-1] = databaseName\xFE";
 z+="                End Try\xFE";
 z+="           Else\xFE";
 z+="               databaseNames[-1] = databaseName\xFE";
 z+="           End If\xFE";
 z+="        Next\xFE";
 z+="    Else\xFE";
 z+="        Dim fSystem As FileHandle\xFE";
 z+="        Open \"system\" To fSystem Else return [@errors]\xFE";
