var z="// Routine to make a SQL Temporary copy of a table/view\xFE";
 z+="// Attach SQL database before calling\xFE";
 z+="// -> returns an fHandle\xFE";
 z+="//\xFE";
 z+="function dbMakeTmpTable(ByVal fromViewName As String) As TableHandle\xFE";
 z+="    * $options aspx\xFE";
 z+="    \xFE";
 z+="    // We can't close our connection or the tmp table will be dropped\xFE";
 z+="    Dim odbAccount As Object = system(17).mAttachedDB\xFE";
 z+="    if !odbAccount then return null\xFE";
 z+="    \xFE";
 z+="    odbAccount.OpenAndCLoseConnections = 1\xFE";
 z+="    odbAccount.closeAdo(0)\xFE";
 z+="    odbAccount.OpenAndCLoseConnections = 0\xFE";
 z+=" \xFE";
 z+="    Dim tmpTblName As String = \"##dview_\":fromViewName:\"_\":niceName(@UserName)\xFE";
 z+="    Dim fTmpHandle As TableHandle\xFE";
 z+="    i_open tmpTblName to fTmpHandle Then \xFE";
 z+="        i_deletefile fTmpHandle else return Null\xFE";
 z+="    end if\xFE";
 z+="        \xFE";
 z+="    Dim tSql As String = \"Select * into [\":tmpTblName:\"] from [\":fromViewName:\"]\"\xFE";
 z+="    Try\xFE";
 z+="        r = Sql(tSql)\xFE";
 z+="        Open tmpTblName To fTmpHandle Then return fTmpHandle\xFE";
 z+="    End Try\xFE";
 z+="\xFE";
 z+="    return null\xFE";
 z+="end function\xFE";
 z+="\xFE";
 z+="function @@db_MakeTmpTable(ByVal fromViewName As String) As TableHandle\xFE";
 z+="    return dbMakeTmpTable(fromViewName)\xFE";
 z+="end function\xFE";
 z+=""
