window.cached_jsb_bf["dbnextprimarykey"]="function dbNextPrimaryKey(ByVal TableName As String, ByVal primaryKeyName As String) As Integer\xFE    Dim f as fileHandle\xFE    Open TableName to f else return 1\xFE    \xFE    if IsSqlServer(f) Then \xFE        Return Sql(\"select Max([\":primaryKeyName:\"]) from [\":TableName:\"]\") + 1\xFE    End if\xFE    \xFE    dim SL As SelectList\xFE    select f to SL else return 1\xFE    \xFE    Dim X As Array = getlist(SL)\xFE    Dim LastID As Integer = 0\xFE\xFE    For each ID As Integer in X\xFE         If Id > LastID Then LastID = ID\xFE    Next\xFE    \xFE    Return LastID + 1\xFEend function\xFE";
var z="/* Loop on each database, get by LoginName - each permission\xFE";
 z+="   returns:\xFE";
 z+="   \xFE";
 z+="        { \xFE";
 z+="          LoginName:  { \xFE";
 z+="              databaseName: [permissions...],\xFE";
 z+="              atabaseName: [permissions...],\xFE";
 z+="              ...\xFE";
 z+="          },\xFE";
 z+="          ...\xFE";
 z+="        }\xFE";
 z+="*/\xFE";
 z+="\xFE";
 z+="function dbPermissions()\xFE";
 z+="    * $options aspxc-, aspx\xFE";
 z+="    \xFE";
 z+="    attachedDB = @Session.AttachedDatabase\xFE";
 z+="    dbList = dbGetDatabaseNames()\xFE";
 z+="    \xFE";
 z+="    if !attachedDB Then \xFE";
 z+="        Attachdb \"databaseBuilder_rw\" Else         \xFE";
 z+="            alert(@errors)\xFE";
 z+="            return names\xFE";
 z+="        end if\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    results = {}\xFE";
 z+="    for each dbName in dbList\xFE";
 z+="        cmd = `\xFE";
 z+="          use [`:dbName:`];\xFE";
 z+="          \xFE";
 z+="          SELECT \xFE";
 z+="                UserType = \xFE";
 z+="                   CASE mmbrp.[type] \xFE";
 z+="                   WHEN 'G' THEN 'Windows Group' \xFE";
 z+="                   WHEN 'S' THEN 'SQL User' \xFE";
 z+="                   WHEN 'U' THEN 'Windows User' \xFE";
 z+="                   END,\xFE";
 z+="                 UserName = mmbrp.[name],\xFE";
 z+="                 LoginName = ul.[name],\xFE";
 z+="                 Role = rolp.[name]\xFE";
 z+="              FROM sys.database_role_members mmbr, -- The Role OR members associations table\xFE";
 z+="                 sys.database_principals rolp,     -- The DB Roles names table\xFE";
 z+="                 sys.database_principals mmbrp,    -- The Role members table (database users)\xFE";
 z+="                 sys.server_principals ul          -- The Login accounts table\xFE";
 z+="              WHERE Upper (mmbrp.[type]) IN ( 'S', 'U', 'G' )\xFE";
 z+="                 -- No need for these system account types\xFE";
 z+="                 AND Upper (mmbrp.[name]) NOT IN ('SYS','INFORMATION_SCHEMA')\xFE";
 z+="                 AND rolp.[principal_id] = mmbr.[role_principal_id]\xFE";
 z+="                 AND mmbrp.[principal_id] = mmbr.[member_principal_id]\xFE";
 z+="                 AND ul.[sid] = mmbrp.[sid]\xFE";
 z+="                 -- AND rolp.[name] LIKE '%DEFAULT%'\xFE";
 z+="              \xFE";
 z+="        `\xFE";
 z+="    \xFE";
 z+="        sqlSelect Cmd to sl else \xFE";
 z+="            alert(@errors)\xFE";
 z+="            cycle\xFE";
 z+="        end if\xFE";
 z+="        \xFE";
 z+="        rows = getList(sl)\xFE";
 z+="        for each row in rows\xFE";
 z+="            UserType = row.UserType\xFE";
 z+="            UserName = row.UserName\xFE";
 z+="            LoginName = row.LoginName\xFE";
 z+="            Role = row.Role\xFE";
 z+="            \xFE";
 z+="            user = results[LoginName]\xFE";
 z+="            if !user then \xFE";
 z+="                user = {}\xFE";
 z+="                results[LoginName] = user\xFE";
 z+="            end if\xFE";
 z+="            \xFE";
 z+="            dbRoles = user[dbName]\xFE";
 z+="            if !db Then\xFE";
 z+="                dbRoles = []\xFE";
 z+="                user[dbName] = dbRoles\xFE";
 z+="            end if\xFE";
 z+="            \xFE";
 z+="            locate role in dbRoles else dbRoles[-1] = role\xFE";
 z+="        next\xFE";
 z+="    next\xFE";
 z+="    \xFE";
 z+="    Attachdb attachedDB Else Null\xFE";
 z+="    return results\xFE";
 z+="end function\xFE";
 z+=""
