var z="/*\xFE";
 z+="    //----------------------------\xFE";
 z+="    // Usage examples:\xFE";
 z+="    //----------------------------\xFE";
 z+=" \xFE";
 z+="    * Get all the available error log data\xFE";
 z+="    print dbReadErrorLog()  // Will return a really big Array of JSON { }\xFE";
 z+=" \xFE";
 z+="    * Get all the available error log data from a certain date\xFE";
 z+="    print dbReadErrorLog(\"\", \"\", date(now() - 30))\xFE";
 z+=" \xFE";
 z+="    * Get all the available error log data between certain dates\xFE";
 z+="    print dbReadErrorLog(\"\", \"\", date(now() - 30), date(now() - 2))\xFE";
 z+=" \xFE";
 z+="    * Get the content with messages containing the strings 'Error' and 'Severity'\xFE";
 z+="    print dbReadErrorLog('ERROR', 'Severity')\xFE";
 z+=" \xFE";
 z+="    * Get the content since a certain date with messages containing the strings 'Error' and 'Severity'\xFE";
 z+="    print dbReadErrorLog('ERROR', 'Severity', date(now() - 30))\xFE";
 z+=" \xFE";
 z+="    * Get the content between two dates with messages containing the strings 'Error' and 'Severity'\xFE";
 z+="    print dbReadErrorLog('ERROR', 'Severity', date(now() - 30), date(now() - 2))\xFE";
 z+=" \xFE";
 z+="    * Get the content between two dates with messages containing the strings 'Error' and 'Severity' +\xFE";
 z+="    *   show the adjacent 1 row above and below the row with matching text\xFE";
 z+="    print dbReadErrorLog('Error', 'Severity', date(now() - 30), date(now() - 2), 1)\xFE";
 z+=" \xFE";
 z+="*/\xFE";
 z+="\xFE";
 z+="\xFE";
 z+="// returns array of JSON [ { LogDate: date, ProcessInfo: \"spidxx\", LogText: \".....\" } ]\xFE";
 z+="\xFE";
 z+="function dbReadErrorLog(optional byval searchString1, optional byval searchString2, optional byval NotSearchString3, optional byval NotSearchString4, optional byval fromDate, optional byval toDate, optional byval SearchShowAdjacentLogsPlusMinus)\xFE";
 z+="    * $options aspxc-, aspx\xFE";
 z+="    \xFE";
 z+="    attachedDB = @Session.AttachedDatabase\xFE";
 z+="    events = []\xFE";
 z+="    \xFE";
 z+="    if !attachedDB Then \xFE";
 z+="        Attachdb \"databaseBuilder_rw\" Else         \xFE";
 z+="            alert(@errors)\xFE";
 z+="            return events\xFE";
 z+="        end if\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    // Does the stored procedure spReadAllErrorLogs exist?\xFE";
 z+="    Cmd = `SELECT * FROM sys.objects WHERE type = 'P' AND name = 'spReadAllErrorLogs'`\xFE";
 z+="    r = Sql(Cmd)\xFE";
 z+="    if !r Or True Then\xFE";
 z+="        r = Sql(`DROP PROCEDURE spReadAllErrorLogs;`)\xFE";
 z+="        Cmd = `\xFE";
 z+="            CREATE PROCEDURE spReadAllErrorLogs\xFE";
 z+="               @FromDate DATETIME = NULL,\xFE";
 z+="               @ToDate DATETIME = NULL,\xFE";
 z+="               @SearchString1 NVARCHAR(255) = NULL,\xFE";
 z+="               @SearchString2 NVARCHAR(255) = NULL,\xFE";
 z+="               @NotSearchString3 NVARCHAR(255) = NULL,\xFE";
 z+="               @NotSearchString4 NVARCHAR(255) = NULL,\xFE";
 z+="               @SearchShowAdjacentLogsPlusMinus INT = 0  --Shows this many log records before and after the line matching \"SearchString\"\xFE";
 z+="                                                         --If there are multiple rows with the exact LogDate, \"adjacent\" becomes inaccurate ..still useful\xFE";
 z+="            AS\xFE";
 z+="            BEGIN\xFE";
 z+="             \xFE";
 z+="                /*\xFE";
 z+="                v1.0  - Apr 19, 2018 - Jana Sattainathan [Twitter: @SQLJana] [Blog: sqljana.wordpress.com]\xFE";
 z+="                */\xFE";
 z+="             \xFE";
 z+="                DECLARE @ArchiveNumber INT;\xFE";
 z+="             \xFE";
 z+="                IF object_id('TEMPDB.DBO.##TempLogList1') IS NOT NULL\xFE";
 z+="                    DROP TABLE ##TempLogList1;\xFE";
 z+="                IF object_id('TEMPDB.DBO.#TempLogList2') IS NOT NULL\xFE";
 z+="                    DROP TABLE #TempLogList2;\xFE";
 z+="                IF object_id('TEMPDB.DBO.#TempLog1') IS NOT NULL\xFE";
 z+="                    DROP TABLE #TempLog1;\xFE";
 z+="                IF object_id('TEMPDB.DBO.#TempLog1') IS NOT NULL\xFE";
 z+="                    DROP TABLE #TempLog2;\xFE";
 z+="             \xFE";
 z+="                CREATE TABLE ##TempLogList1(\xFE";
 z+="                    ArchiveNumber INT NOT NULL,\xFE";
 z+="                    --LogFromDate DATE NOT NULL,\xFE";
 z+="                    LogToDate DATE NOT NULL,\xFE";
 z+="                    LogSizeBytes BIGINT NOT NULL);\xFE";
 z+="             \xFE";
 z+="                CREATE TABLE #TempLog1(\xFE";
 z+="                    LogDate     DATETIME,\xFE";
 z+="                    ProcessInfo VARCHAR(64),\xFE";
 z+="                    LogText     VARCHAR(MAX));\xFE";
 z+="             \xFE";
 z+="                CREATE TABLE #TempLog2(\xFE";
 z+="                    LogDate     DATETIME,\xFE";
 z+="                    ProcessInfo VARCHAR(64),\xFE";
 z+="                    LogText     VARCHAR(MAX));\xFE";
 z+="             \xFE";
 z+="                --Get the list of all logs available (current and archived)\xFE";
 z+="                INSERT INTO ##TempLogList1\xFE";
 z+="                EXEC sys.sp_enumerrorlogs;\xFE";
 z+="             \xFE";
 z+="                --LogFromDate is populated here\xFE";
 z+="                SELECT\xFE";
 z+="                    ArchiveNumber,\xFE";
 z+="                    COALESCE((LEAD(LogToDate) OVER (ORDER BY ArchiveNumber)), '20000101') LogFromDate,\xFE";
 z+="                    LogToDate,\xFE";
 z+="                    LogSizeBytes\xFE";
 z+="                INTO\xFE";
 z+="                    #TempLogList2\xFE";
 z+="                FROM\xFE";
 z+="                    ##TempLogList1\xFE";
 z+="                ORDER BY\xFE";
 z+="                    LogFromDate, LogToDate;\xFE";
 z+="             \xFE";
 z+="                --Remove archive logs whose date criteria does not fit the parameters\xFE";
 z+="                --....and No, it is not a mistake that the comparison has the two dates interchanged! Just think for a few minutes\xFE";
 z+="                DELETE FROM #TempLogList2\xFE";
 z+="                WHERE LogToDate < COALESCE(@FromDate, '20000101')            OR LogFromDate > COALESCE(@ToDate, '99991231');\xFE";
 z+="             \xFE";
 z+="                --Loop through and get the list\xFE";
 z+="                WHILE 1=1\xFE";
 z+="                BEGIN\xFE";
 z+="                    SELECT @ArchiveNumber = MIN(ArchiveNumber)\xFE";
 z+="                    FROM #TempLogList2;\xFE";
 z+="             \xFE";
 z+="                    IF @ArchiveNumber  IS NULL\xFE";
 z+="                      BREAK;\xFE";
 z+="             \xFE";
 z+="                    --Insert the error log data into our temp table\xFE";
 z+="                    --Read the errorlog data\xFE";
 z+="                    /*\xFE";
 z+="                    --https://www.mssqltips.com/sqlservertip/1476/reading-the-sql-server-log-files-using-tsql/\xFE";
 z+="                    This procedure takes four parameters:\xFE";
 z+="             \xFE";
 z+="                    Value of error log file you want to read: 0 = current, 1 = Archive #1, 2 = Archive #2, etc...\xFE";
 z+="                    Log file type: 1 or NULL = error log, 2 = SQL Agent log\xFE";
 z+="                    Search string 1: String one you want to search for\xFE";
 z+="                    Search string 2: String two you want to search for to further refine the results\xFE";
 z+="                    */\xFE";
 z+="                    INSERT INTO #TempLog1\xFE";
 z+="                    EXEC xp_readerrorlog @ArchiveNumber, 1, @SearchString1, @SearchString2, @FromDate, @ToDate, 'ASC'\xFE";
 z+="                    \xFE";
 z+="                    if (@NotSearchString3 IS NOT NULL) \xFE";
 z+="                        DELETE FROM #TempLog1 WHERE LogText Like '%' + @NotSearchString3 + '%';\xFE";
 z+="                        \xFE";
 z+="                    if (@NotSearchString4 IS NOT NULL) \xFE";
 z+="                        DELETE FROM #TempLog1 WHERE LogText Like '%' + @NotSearchString4 + '%';\xFE";
 z+="                           \xFE";
 z+="                    IF (@SearchShowAdjacentLogsPlusMinus > 0)\xFE";
 z+="                        --This is purely to get the adjacent records\xFE";
 z+="                        INSERT INTO #TempLog2\xFE";
 z+="                        EXEC xp_readerrorlog @ArchiveNumber, 1, NULL, NULL, @FromDate, @ToDate, 'ASC';\xFE";
 z+="             \xFE";
 z+="                    --Remove just processed archive number from the list\xFE";
 z+="                    DELETE FROM #TempLogList2\xFE";
 z+="                    WHERE ArchiveNumber = @ArchiveNumber;\xFE";
 z+="                END;\xFE";
 z+="             \xFE";
 z+="                IF (@SearchShowAdjacentLogsPlusMinus <= 0)\xFE";
 z+="                    SELECT * FROM #TempLog1\xFE";
 z+="                    ORDER BY LogDate ASC;\xFE";
 z+="                ELSE\xFE";
 z+="                BEGIN\xFE";
 z+="             \xFE";
 z+="                    --To give the search text some context, we include the log records adjacent to the ones\xFE";
 z+="                    --  that matched the search criteria. For example search string \"error\" would match\xFE";
 z+="                    --  \"Error: 1101, Severity: 17, State: 12.\". However, to get the context, we need\xFE";
