 z+="    newDBFilePath = ReplaceI(dbFilePath, dbName:\".mdf\", newDBName)\xFE";
 z+="    \xFE";
 z+="    logFilePath = dbLogFileLocation(dbName)\xFE";
 z+="    If !logFilePath Then Return False\xFE";
