 z+="    newLogFilePath = ReplaceI(logFilePath, dbName:\"_log.ldf\", newLogName)\xFE";
 z+="\xFE";
 z+="    If dbFilePath = newDBFilePath Or logFilePath = newLogFilePath Then\xFE";
 z+="        @Errors = \"The physical database location is inconsistent with the database name. Rename failed.\" : Crlf() : dbFilePath : Crlf() : logFilePath\xFE";
 z+="        Return False\xFE";
