 z+="    Cmds[-1] = `exec sp_renamedb @dbname = '`:dbName:`' , @newname = '`:newName:`';`\xFE";
 z+="    Cmds[-1] = `ALTER DATABASE [`:newName:`] MODIFY FILE (NAME = '`:dbName:`', FILENAME = '`:newDBFilePath:`');`\xFE";
 z+="    Cmds[-1] = `ALTER DATABASE [`:newName:`] MODIFY FILE (NAME = '`:dbName:`_log', FILENAME = '`:newLogFilePath:`');`\xFE";
