 z+="function dbTableSchema(ByVal databaseName As String, optional ByVal FileName As String) As JSON \xFE";
 z+="    * $options aspx\xFE";
 z+="    Dim attachedDB As String = @Session.AttachedDatabase\xFE";
 z+="    Dim aSchemaDefs As Array = []\xFE";
 z+="    Dim Results As Json = {}\xFE";
 z+="    \xFE";
 z+="    if isMissing(fileName) Then\xFE";
 z+="        fileName = databaseName\xFE";
 z+="        databaseName = \"\"\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    if databaseName then attachdb databaseName else stop @errors\xFE";
 z+="    \xFE";
 z+="    // Allow Dictionary items to override some values \xFE";
 z+="    Open FileName To fHandle As FileHandle Else \xFE";
 z+="        if attachedDB then attachdb attachedDB else null\xFE";
 z+="        Return Null\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    dim flatFile as boolean = false\xFE";
 z+="    If TypeOfFile(fHandle) = \"ado\" Then\xFE";
 z+="        aSchemaDefs = fHandle.GetSchema()\xFE";
 z+="        for each Column As Json in aSchemaDefs\xFE";
 z+="            if Column.ColumnName = \"ItemContent\" Then\xFE";
 z+="                flatFile = true\xFE";
 z+="                break\xFE";
 z+="            end if\xFE";
 z+="        next\xFE";
 z+="    Else\xFE";
 z+="        flatFile = True\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    if flatFile Then\xFE";
 z+="        select \"top 1000 *\" from fHandle to ss Then \xFE";
 z+="            Dim Dataset As Array = GetList(ss)\xFE";
 z+="        \xFE";
 z+="            If !Len(Dataset) Then \xFE";
 z+="                @Errors = 'No records found to analyse'; \xFE";
 z+="            Else\xFE";
 z+="                Dim PK As String = \"\"\xFE";
 z+="                aSchemaDefs = analyseJson(Dataset, Pk, False)\xFE";
 z+="                if Len(aSchemaDefs) Then \xFE";
 z+="                    if hasTag(aSchemaDefs, \"ordinal\") Then aSchemaDefs = @Sort(aSchemaDefs, \"#>ordinal\")\xFE";
 z+="                    if hasTag(aSchemaDefs, \"Ordinal\") Then aSchemaDefs = @Sort(aSchemaDefs, \"#>Ordinal\")\xFE";
 z+="                End If\xFE";
 z+="            end if\xFE";
 z+="        end if\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    Dim Results As Json = {}\xFE";
 z+="    For Each sRow In aSchemaDefs\xFE";
 z+="        if sRow.ColumnName Then \xFE";
 z+="            jRow = ColumnDef2JSB(sRow)\xFE";
 z+="            Dim RowName As String = jRow.name\xFE";
 z+="            if RowName then Results[RowName] = jRow\xFE";
 z+="        Else If sRow.name Then\xFE";
 z+="            Results[sRow.name] = sRow\xFE";
 z+="        End If\xFE";
 z+="        \xFE";
 z+="    Next\xFE";
 z+="    if attachedDB then attachdb attachedDB else null\xFE";
 z+="    Return Results\xFE";
 z+="    \xFE";
 z+="End function\xFE";
 z+="\xFE";
 z+="function @@dbTableSchema(ByVal databaseName As String, ByVal FileName As String)\xFE";
 z+="    Return dbTableSchema(databaseName, FileName)\xFE";
 z+="end function\xFE";
