var z="function formatCode(ByVal Code As String, Optional ByVal Indentation As Integer, Optional ByVal showProgress) As Array\xFE";
 z+="* $options async-, aspxc-\xFE";
 z+="\xFE";
 z+="    If IsMissing(Indentation) Then Indentation = 4\xFE";
 z+="    Ni = Indentation\xFE";
 z+="    Am = Chr(254)\xFE";
 z+="    MixCase = ['if', 'then', 'for', 'next', 'loop', 'elseif', 'while', 'until', 'ubound', 'chr', 'lbound', 'count', 'dcount', 'repeat',\xFE";
 z+="    'index', 'replace', 'ucase', 'lcase', 'function', 'subroutine', 'sub', 'func', 'end', 'else', 'in', 'each', 'left', 'right',\xFE";
 z+="    'mid', 'and', 'or', 'not', 'true', 'false', 'nothing', 'restful', 'instr', 'field', 'rtrim', 'ltrim', 'hastag']\xFE";
 z+="    \xFE";
 z+="    FTWords = ['lcase', 'ucase', 'ltrim', 'rtrim', 'lbound', 'ubound', 'hastag', 'elseif', 'var', 'function', 'this', 'window']\xFE";
 z+="    RPWords = ['LCase', 'UCase', 'LTrim', 'RTrim', 'LBound', 'UBound', 'HasTag', 'ElseIf', 'var', 'function', 'this', 'window']\xFE";
 z+="    \xFE";
 z+="    Code = Replace(Code, Chr(9), \" \")\xFE";
 z+="    Code = Replace(Code, Crlf(), Am)\xFE";
 z+="    Item = Split(Code, Am)\xFE";
 z+="    If UBound(Item) > 10000 Then Return Item\xFE";
 z+="    Line1 = Item[1]\xFE";
 z+="    if Left(LTrim(Line1), 1) = \"{\" Then Return Item\xFE";
 z+="    \xFE";
 z+="    C255 = Chr(255)\xFE";
 z+="    Ts = Timer() + 10000\xFE";
 z+="    SMarkers = `\"'`:\"`\"\xFE";
 z+="    UserWords = []\xFE";
 z+="    LUserWords = []\xFE";
 z+="    inJson = 0\xFE";
 z+="    InJavascriptBlock = 0\xFE";
 z+="    InScriptBlock = 0\xFE";
 z+="            \xFE";
 z+="    For Linei = 1 To UBound(Item)\xFE";
 z+="        if showProgress Then Print \"*\":\xFE";
 z+="        Sline = Item[Linei]\xFE";
 z+="        Ci = Ni\xFE";
 z+="        Skiptoeoc = False\xFE";
 z+="        CheckLbl = Sline[1, 1] <> \" \"\xFE";
 z+="        Sline = LTrim(Sline)\xFE";
 z+="        Lbl = \"\"\xFE";
 z+="        \xFE";
 z+="        * Ignore anything starting with a comment marker\xFE";
 z+="        If Instr(`*!'/`, Sline[1, 1]) Then\xFE";
 z+="            // Line starts with a comment\xFE";
 z+="            //   If comment at BOL, leave it there, else put it at correct indentation\xFE";
 z+="            If !CheckLbl Then Item[Linei] = Space(Ci) : Sline\xFE";
 z+="        Else\xFE";
 z+="            * Remove labels, will put them back later\xFE";
 z+="            If CheckLbl Then\xFE";
 z+="                LblI = Index(Sline, \":\", 1)\xFE";
 z+="                \xFE";
 z+="                * Find first thing that isn't part of a label (default to eol)\xFE";
 z+="                J = Len(Sline) + 1\xFE";
 z+="                T = Index(Sline, \" \", 1); If T<J And T> 0 Then J = Index(Sline, \" \", 1)\xFE";
 z+="                T = Index(Sline, \"*\", 1); If T<J And T> 0 Then J = Index(Sline, \"*\", 1)\xFE";
 z+="                T = Index(Sline, \"=\", 1); If T<J And T> 0 Then J = Index(Sline, \"=\", 1)\xFE";
 z+="                T = Index(Sline, \"(\", 1); If T<J And T> 0 Then J = Index(Sline, \"(\", 1)\xFE";
 z+="                \xFE";
 z+="                * Anything starting with a number is assumed to be a label\xFE";
 z+="                If LblI = 0 And Num(Sline[1, 1]) Then LblI = J\xFE";
 z+="                If LblI>J Then LblI = 0\xFE";
 z+="                If LblI>1 And LblI <= J Then\xFE";
 z+="                    Lbl = LTrim(Sline[1, LblI - 1] : \": \")\xFE";
 z+="                    If Sline[LblI, 1] = \":\" Then\xFE";
 z+="                        Sline = LTrim(Sline[LblI + 1, 999])\xFE";
 z+="                    End Else\xFE";
 z+="                        Sline = LTrim(Sline[LblI, 999])\xFE";
 z+="                    End\xFE";
 z+="                End\xFE";
 z+="            End If\xFE";
 z+="            \xFE";
 z+="            Words = Split(Replace(Sline, ' ', C255), 1)\xFE";
 z+="            nLine = []\xFE";
