 z+="                End If\xFE";
 z+="            Next\xFE";
 z+="            \xFE";
 z+="            Sline = RTrim(Join(Words, ''))\xFE";
 z+="            \xFE";
 z+="            // Mast out strings (NSLINE) - use this to determine indentation\xFE";
 z+="            Nsline = ''\xFE";
 z+="            If Index(Sline, '\"', 1) Or Index(Sline, \"'\", 1) Or Index(Sline, \"`\", 1) Then\xFE";
