 z+="                *******************************************************************************************************************\xFE";
 z+="                *******************************************************************************************************************\xFE";
 z+="                R = 1; Loop While Index(Nsline, '{', R) Do Ni = Ni + Indentation; R = R + 1 Repeat\xFE";
