var z="*\xFE";
 z+="* Grids and Trees automatically look for and fire events for EventCode Cmds: Select,Rename,Insert,Delete\xFE";
 z+="*\xFE";
 z+="* add your own with @jsb_bf.AttachToEvent('#id', 'xxx', '\"function () { eventHandler_xxx({ v:$(this).val() }, 'v') }\"')\xFE";
 z+="*\xFE";
 z+="*   print ComboBox('someid', ['USHI0026:1:US', 'USID0025', 'BDXX0002:1:BD', 'SCA0500:1:US']):\xFE";
 z+="*   print AttachToEvent('#someid', 'change', \"function () { eventHandler_change({ v:$(this).val() }, 'v') }\"):\xFE";
 z+="*\xFE";
 z+="*   Print genEventHandler(\"rowSelected\", null, 11, \"alert('You selected the row');\"): \xFE";
 z+="*   Print genEventHandler(\"dblClickRow\", null, 11, \"alert('You doubled clicked the row');\"): \xFE";
 z+="*   print\xFE";
 z+="*\xFE";
 z+="* Sample url build:\xFE";
 z+="*    url = @jsbRootExecuteTclCmd(\"view FileName '{id}'\" )\xFE";
 z+="*    url = @jsbRestCall(\"view?arg1=\":@UrlEncode(FileName):\"&arg2={id}\" )\xFE";
 z+="*\xFE";
