 z+="    //        Print @jsb_bf.genEventHandler(\"dblClick\", @jsbRootAccount():\"?dbwSelect/{id}\", 1, containerName):     \xFE";
 z+="    //\xFE";
 z+="    //    Declare a function for TREEs\xFE";
