 z+="    //  U C(UrlExtra)    8:  Httpget from Url with {id} (if containerName given then it is Url Extra)\xFE";
 z+="    //  U                9:  (Unused)\xFE";
 z+="    //  U C(UrlExtra)   10:  Openin current window (if containerName given then it is Url Extra)\xFE";
 z+="    //    C(javascript) 11:  pure javascript in containerName.  If Url given, then it is opened in current window\xFE";
 z+="    //  U C(UrlExtra)   12:  Openin top window (if containerName given then it is Url Extra)\xFE";
 z+="    //                  13:  Back Page: due window history back (uses fromPage if it exists)\xFE";
 z+="    //                  14:  Next Tab\xFE";
 z+="    //                  15:  Previous Tab\xFE";
 z+="    //                  16:  Close Window\xFE";
 z+="    //                  17:  Return a PICK value\xFE";
 z+="    //    C(jsGridID)   18: Force jqGrid to reload (containerName is jqGridID) - does $('#':jqGridID).trigger( 'reloadGrid' );\xFE";
 z+="    \xFE";
 z+="*   Types: 10, 12, 13, 14, 16 will warn if page is dirty (window._isDirty)\xFE";
 z+="*   Types: 3, 4,, 5, 7, 11 & 18 require C\xFE";
 z+="\xFE";
 z+="Function genEventHandler(ByVal eventName As String, Byval Url As String, ByVal containerType As Integer, ByVal containerName As String, optional byval addFromPage As Boolean, optional byval passthruParams As Boolean) As String\xFE";
 z+="* $options async-\xFE";
 z+="    Dim S As Array\xFE";
 z+="    Dim I As Integer\xFE";
 z+="    Dim GENURL As String\xFE";
 z+="    Dim MSG As String\xFE";
 z+="\xFE";
 z+="    If Val(containerType) = 0 Then containerType = 2\xFE";
 z+="    S = []\xFE";
 z+="\xFE";
 z+="    genUrl = Url\xFE";
 z+="    If containerName Then\xFE";
 z+="        If Index(LCase(genUrl), \"{containername}\") Then\xFE";
 z+="            Loop\xFE";
 z+="                I = Index(LCase(genUrl), \"{containername}\")\xFE";
 z+="            While I Do\xFE";
 z+="                genUrl = Left(genUrl, I-1):containerName:Mid(genUrl, I + Len(\"containerName\"))\xFE";
 z+="            Repeat\xFE";
 z+="        ElseIf containerType = 1 Or containerType = 2 Or containerType = 8 Or containerType = 10 Or containerType = 12 Or containerType = 13 Then\xFE";
 z+="            genUrl = RTrim(genUrl)\xFE";
 z+="            If Right(genUrl, 1) = \"?\" Or Right(genUrl, 1) = \"&\" Or Left(containerName, 1) = \"?\" Or Left(containerName, 1) = \"&\" Then\xFE";
 z+="                genUrl = genUrl : containerName\xFE";
 z+="            Else\xFE";
 z+="                If Instr(genUrl, \"?\") Then genUrl = genUrl : \"&\": containerName Else genUrl = genUrl : \"?\" : containerName\xFE";
 z+="            End If\xFE";
 z+="        End If\xFE";
 z+="    End If\xFE";
 z+="    if Right(genUrl, 1) = \"?\" Or Right(genUrl, 1) = \"&\" Then genUrl = Left(genUrl, Len(genUrl)-1)\xFE";
 z+="    genUrl = jsEscapeString(genUrl)\xFE";
 z+="    \xFE";
 z+="    if InStr(genUrl, \"{\") Or InStr(genURL, \"%7B\") Then  genUrl = `urlCtlSubstitutions(`:genUrl:`, parentDataRow, primaryKeyName); `\xFE";
 z+="    \xFE";
 z+="    S[-1] = `function eventHandler_`:eventName:`(parentDataRow, primaryKeyName) {`\xFE";
 z+="    S[-1] = `   var selectedID = parentDataRow[primaryKeyName];`\xFE";
 z+="    \xFE";
 z+="    If containerType = 13 Then\xFE";
 z+="        S[-1] = ` var Url = queryVar(\"frompage\");`\xFE";
 z+="        if genUrl Then S[-1] = ` if (!Url) Url = `:genUrl Else S[-1] = ` if (!Url) return window.history.back();`\xFE";
 z+="    Else\xFE";
 z+="        S[-1] = `   var Url = `:genUrl\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    S[-1] = `   if ((gup('inTheme')==1) && (InStr(Url, 'inTheme=')==-1)) {`\xFE";
 z+="    S[-1] = `      if (InStr(Url, '?') > 0) Url += '&inTheme=1'; else Url += '?inTheme=1';`\xFE";
 z+="    S[-1] = `   }`\xFE";
 z+="\xFE";
 z+="    If addFromPage Then\xFE";
 z+="        S[-1] = `   if (InStr(Url, '?') > 0) Url += '&fromPage=' + urlEncode(myLocation()); else Url += '?fromPage=' + urlEncode(myLocation()); `\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    If passthruParams Then\xFE";
 z+="        S[-1] = `   passthruParams = Replace(Replace(Field(myLocation(), '?', 2), 'new1rec=newRecord', ''), '&&', '&'); `\xFE";
 z+="        S[-1] = `   if (passthruParams) {`\xFE";
 z+="        S[-1] = `      if (InStr(Url, '?') > 0) Url += '&' + passthruParams; else Url += '?' + passthruParams;`\xFE";
 z+="        S[-1] = `   } `\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    * S[-1] = `   alert('on parent `:eventName:` Url' + Url +' ct: `:containerType:`');`\xFE";
 z+="    \xFE";
 z+="*   10 open in current window (if containerName given then it is Url Extra)\xFE";
 z+="*   11 pure javascript in containerName\xFE";
 z+="*   12 open in top window (if containerName given then it is Url Extra)\xFE";
 z+="\xFE";
 z+="*   13 Back Page: due window history back (uses fromPage if it exists)\xFE";
 z+="\xFE";
 z+="*   16 Close Window\xFE";
 z+="*   17 Return a PICK value\xFE";
 z+="*   18 Force jqGrid to reload (containerName is jqGridID) - does $('#':jqGridID).trigger( 'reloadGrid' );\xFE";
 z+="*   \xFE";
 z+="*   Types: 10, 12, 13, 16 will warn if page is dirty (window._isDirty)\xFE";
 z+="*\xFE";
 z+="    Select Case containerType\xFE";
 z+="        case 11:\xFE";
 z+="            if Url Then Msg = \"leave this page\"\xFE";
 z+="        case 10, 12:  ;* open URL\xFE";
 z+="            Msg = \"leave this page\"\xFE";
 z+="        case 13: ;* go back\xFE";
 z+="            Msg = \"leave this page\"\xFE";
 z+="        case 16: ;* close\xFE";
 z+="            Msg = \"close this page\"\xFE";
 z+="        case else\xFE";
 z+="            Msg = \"\"\xFE";
 z+="    end select\xFE";
 z+="    \xFE";
 z+="    if Msg Then\xFE";
 z+="         S[-1] = `   if (window._isDirty) {`\xFE";
 z+="         S[-1] = `      if (!confirm(\"You have changed this record, are you sure you want to `:Msg:`?\")) return false; `\xFE";
 z+="         S[-1] = `   }`\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    Select Case containerType\xFE";
 z+="        Case 1: * Open In A New Window\xFE";
 z+="            S[-1] = `   new windowOpen(Url, '_blank'); ` ;* 'height=' + $(Window).height() + ',width=' + $(Window).width()\xFE";
 z+="\xFE";
 z+="        Case 2: * Open In A New Window Tab\xFE";
 z+="            S[-1] =       `new windowOpen(Url, '_blank');`\xFE";
 z+="\xFE";
 z+="        Case 3: * Open In A New jQuery Tab (containerName Is The TabID, Title: Is The Name To Use For The New Or Existing Tab)\xFE";
 z+="            S[-1] = `   openInTab(\"`:containerName:`\", stripNonIdentifierCharacters(selectedID), selectedID, Url, Url); `\xFE";
 z+="\xFE";
 z+="        Case 4: * Open In An Iframe\xFE";
 z+="            S[-1] = `   openInIFrame(\"`:containerName:`\", Url); `\xFE";
 z+="\xFE";
 z+="        Case 5: * Open In A Div\xFE";
 z+="            S[-1] = `   openInDiv(\"`:containerName:`\", Url); `\xFE";
 z+="\xFE";
 z+="        Case 6: * Open In A jQuery Model DIalog\xFE";
 z+="            S[-1] = `   new popoutWindow('`:containerName:`', Url, '80%', 'auto');`\xFE";
 z+="\xFE";
 z+="        Case 7: * Post Back With Hiddenvar (containerName) Set To selectedID\xFE";
 z+="            S[-1] = `  postBack(\"`:containerName:`\", selectedID /* goes into ContainerName */, \"`:eventName:`\" /* goes into postBackTitle */, parentDataRow /* goes into postBackUrl */); `\xFE";
 z+="\xFE";
 z+="        Case 8: * httpGet To Url With Parameter containerName\xFE";
 z+="            S[-1] = `   new windowOpen(Url, '_blank' ); `\xFE";
 z+="\xFE";
 z+="        Case 9: // (Unused)\xFE";
 z+="\xFE";
 z+="        Case 10: * Open In A Current Window\xFE";
 z+="            S[-1] = `   new windowOpen(Url, '_self'); `\xFE";
 z+="\xFE";
 z+="        Case 11: * Pure Javascript In containerName\xFE";
 z+="            S[-1] = containerName:'; '\xFE";
 z+="            if Url Then S[-1] = `   new windowOpen(Url, '_self'); `\xFE";
 z+="\xFE";
 z+="        Case 12: * Open In A Top Window\xFE";
 z+="            S[-1] = `   new windowOpen(Url, '_top'); `\xFE";
 z+="\xFE";
 z+="        Case 13: * Back (fromPage) given\xFE";
 z+="            S[-1] = `   new windowOpen(Url, '_self'); `\xFE";
 z+="\xFE";
 z+="        Case 14:\xFE";
 z+="                * Next Tab\xFE";
 z+="\xFE";
 z+="        Case 15:\xFE";
 z+="                * Previous Tab\xFE";
 z+="\xFE";
 z+="        Case 16:\xFE";
 z+="            S[-1] = ` new windowOpen(jsbRoot() + 'close_html', '_self'); `\xFE";
 z+="\xFE";
 z+="        Case 17: * Return Pick Value\xFE";
 z+="            S[-1] = `   window.location = 'close_html?ans=' + urlDecode(selectedID); `\xFE";
 z+="    End Case\xFE";
 z+="    S[-1] = `    return true; `\xFE";
 z+="    S[-1] = `} `\xFE";
 z+="\xFE";
 z+="    Return @jsb_html.Script(Join(S, Crlf()))\xFE";
 z+="end function"
