var z="Function Get(ByVal Url As String, optional byval method As String, optional ByRef header As Object, optional ByRef body As String, optional ByVal opts As String) As String\xFE";
 z+="*\xFE";
 z+="* Returns Nothing on errors. ie, test with IsNothing(result)\xFE";
 z+="*\xFE";
 z+="* Method: \"GET\", POST, PUT, DELETE\xFE";
 z+="* Header: [\"Content-Type: text/html; charset=utf-8;\", \"Cache-Control: no-store\"] - see //en.wikipedia.org/wiki/List_of_HTTP_header_fields\xFE";
 z+="* Url:    \"//....\"\xFE";
 z+="* Body:   \"_p1=\":@jsb_bf.UrlEncode(DictData):\"&\":\"_p2=\":@jsb_bf.UrlEncode(fName)\xFE";
 z+="* Opts<1>:   \"\" or \"N\" for no redirecting\xFE";
 z+="* Opts<2>: Timeout in seconds\xFE";
 z+="* \xFE";
 z+="    if !method Then method = \"GET\"\xFE";
 z+="    \xFE";
 z+="    if ismissing(body) then\xFE";
 z+="        if method = \"PUT\" or method = \"POST\" then\xFE";
 z+="            body = header\xFE";
 z+="            header = nothing\xFE";
 z+="        end if\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    // Are we profiling?\xFE";
 z+="    if system(64) and !InStr(system(64), \"-\") Then\xFE";
 z+="        Dim gets As Array = @userVar('gets')\xFE";
 z+="        if !gets then gets = []\xFE";
 z+="        gets[-1] = url\xFE";
 z+="        @userVar('gets', gets)\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    method = ucase(method)\xFE";
 z+="    Dim uHeader As String\xFE";
 z+="    If TypeOf(header) = \"Array\" Then \xFE";
 z+="        uHeader = Join(Header, VM()) \xFE";
 z+="    Else If Instr(Header, AM()) Then\xFE";
 z+="        uHeader = Lower(header)\xFE";
 z+="    ElseIf !Header Then\xFE";
 z+="        uHeader = \"Cache-Control: no-store\"\xFE";
 z+="        ' application/json; charset=UTF-8\xFE";
 z+="        If Method = \"POST\" or Method = \"PUT\" Then uHeader<1,-1> = \"Content-Type: application/x-www-form-urlencoded; charset=UTF-8\" \xFE";
 z+="    Else\xFE";
 z+="        uHeader = header\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    Dim ADR As String = Url   \xFE";
 z+="    Dim protocol As String = left(adr, 11)\xFE";
 z+="    if instr(protocol, \":\") Then\xFE";
 z+="        protocol = field(protocol, \":\", 1)\xFE";
 z+="        if left(adr, len(protocol)) = protocol then\xFE";
 z+="            adr = adr[len(protocol) + 2,999]\xFE";
 z+="        End If\xFE";
 z+="    else\xFE";
 z+="        protocol = @protocol\xFE";
 z+="    end if\xFE";
 z+="    protocol := \":\"\xFE";
 z+="    \xFE";
 z+="    if left(adr, 2) = \"//\" Then \xFE";
 z+="        adr = mid(adr, 3)\xFE";
 z+="        protocol := \"//\"\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Dim fhandle As FileHandle\xFE";
 z+="    i_open protocol to fhandle else Return Nothing\xFE";
 z+="\xFE";
 z+="    Dim www As String = adr\xFE";
 z+="    www<2> = Method\xFE";
 z+="    if uheader Then www<3> = uheader\xFE";
 z+="    if (method = \"PUT\" or method = \"POST\") And Body then www<4> = Body\xFE";
 z+="    If Opts Then www<5> = Opts ;* N FOR NO REDIRECT (Also loads www<6> for timeout value)\xFE";
 z+="\xFE";
