 z+="        * \"ColumnName\": \"xxxxxx\", \"DataType\": \"System.Int32\", \"AllowDBNull\": true, \"AutoIncrement\": false, \"AutoIncrementSeed\": 0, \"AutoIncrementStep\": 1, \"Caption\": \"xxxxxxx\", \"DefaultValue\": null, \"MaxLength\": -1, \"ordinal\": 9,\xFE";
