 z+="Function getTableColumnDefs(ByVal TableName As String, optional byval SuppressMsgs As String, optional byval doRefresh As Integer) As Array\xFE";
 z+="    Dim DICTCOLUMNS As Array\xFE";
 z+="    Dim FDICTHANDLE As FileHandle\xFE";
 z+="    Dim FHANDLE As FileHandle\xFE";
 z+="    Dim J As Json\xFE";
 z+="    Dim SL As SelectList\xFE";
 z+="    Dim SS As SelectList\xFE";
 z+="    Dim SQLDEFS As String\xFE";
 z+="    Dim READREADLIST As StRiNg\xFE";
 z+="    Dim ID As String\xFE";
 z+="    Dim ITEMID As String\xFE";
 z+="    Dim ITEM As Variable\xFE";
 z+="\xFE";
 z+="    DictColumns = []\xFE";
 z+="    If TableName = \"\" Then Return DictColumns\xFE";
 z+="\xFE";
 z+="    open \"dict\", TableName to fDictHandle ELse\xFE";
 z+="        open TableName to fHandle else return DictColumns\xFE";
 z+="        fDictHandle = @fHandle(\"DICT\", TableName, true)\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    Select fDictHandle To SL Where \"ItemID like '!%'\" Else \xFE";
 z+="        If !SuppressMsgs Then @Alert('getTableColumnDefs: Unable to select the table DICT ':TableName:\"; \":@Errors)\xFE";
 z+="        Return DictColumns\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    loop\xFE";
 z+="        ReadNext ID From SL Else Break\xFE";
 z+="    while ID Do\xFE";
 z+="        * Column definitions start with !\xFE";
 z+="        ReadJson J From fDictHandle, ID Then \xFE";
 z+="            // update Ordinal to ordinal\xFE";
 z+="            if j.Ordinal then \xFE";
 z+="                if !j.ordinal Then j.ordinal = j.Ordinal\xFE";
 z+="                remove j, \"Ordinal\"\xFE";
 z+="            End if\xFE";
 z+="            if !j.name then j.name = Mid(id, 2)\xFE";
 z+="            DictColumns[-1] = J\xFE";
 z+="        End If\xFE";
 z+="    Repeat\xFE";
 z+="    \xFE";
 z+="    ReadReadList = false\xFE";
 z+="    DictColumns = @Sort(DictColumns, \"#ordinal\")\xFE";
 z+="    \xFE";
 z+="    If Not(doRefresh) and Len(DictColumns) Then Return DictColumns\xFE";
 z+="\xFE";
 z+="    Open \"\", TableName TO fHandle Else \xFE";
 z+="        If !SuppressMsgs Then @Alert('getTableColumnDefs: Unable to open the table ':TableName:\"; \":\"Modeler-\":System(28):\": \":@Errors)\xFE";
 z+="        Return DictColumns\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    if @TypeOfFile(fHandle) = \"ado\"  then\xFE";
 z+="        ' Insure all ADO columns are in DictColumns, if not, add\xFE";
 z+="        SqlDefs = @getSqlTableColumnDefs(fHandle)\xFE";
 z+="        \xFE";
 z+="    Else\xFE";
 z+="        // Test one item to see if it is JSON data, if so give getJSonColumnDefs a try\xFE";
 z+="        Select \"top 1\" from fHandle to SS Else \xFE";
 z+="            If !SuppressMsgs Then @Alert(@Errors)\xFE";
 z+="            return DictColumns\xFE";
 z+="        End If\xFE";
 z+="\xFE";
 z+="        readnext ItemID from SS else return DictColumns\xFE";
 z+="\xFE";
 z+="        read Item From fHandle, ItemID Else \xFE";
 z+="            If !SuppressMsgs Then @Alert(\"Modeler-\":System(28):\": \":@Errors)\xFE";
 z+="            return DictColumns\xFE";
 z+="        End If\xFE";
 z+="\xFE";
 z+="        Item = CJson(Item)\xFE";
 z+="        If !Item Then return DictColumns\xFE";
 z+="        SqlDefs = @getJSonColumnDefs(Item, PrimaryKeyNameFromJSON(Fhandle), ItemID)\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    return @updateColumnDefinitions(TableName, SqlDefs, SuppressMsgs)\xFE";
 z+="end function\xFE";
 z+="\xFE";
 z+="function @@getTableColumnDefs(ByVal TableName As String, optional byval SuppressMsgs As String, optional byval doRefresh As Integer) As Array\xFE";
 z+="    return getTableColumnDefs(TableName, SuppressMsgs, doRefresh)\xFE";
 z+="end function\xFE";
