 z+="    // return distance in meters\xFE";
 z+="    lng1X = 0.017453292519944444 * lng1X;\xFE";
 z+="    lat1Y = 0.017453292519944444 * lat1Y;\xFE";
 z+="    lng2X = 0.017453292519944444 * lng2X;\xFE";
 z+="    lat2Y = 0.017453292519944444 * lat2Y;\xFE";
