window.cached_jsb_bf["gps_latlng2tile"]="// Print LatLng2Tile(44.6663, -115.7029, 20)\xFE//    {\"x\": 187278, \"y\": 378569, \"z\": 20 }\xFE//\xFEfunction gps_LatLng2Tile(byval latY As Integer, byval lngX As Integer, byval zoom As Integer) As JSON\xFE    *$options async-\xFE    Dim x as Single = Floor((lngX + 180) / 360 * Pwr(2, zoom))\xFE    Dim y As Single = Floor((1 - LN(Tan(latY * PI() / 180) + 1 / Cos(latY * PI() / 180)) / PI()) / 2 * Pwr(2, zoom))\xFE    return { x: x, y: y, z: zoom };\xFEend function";
