window.cached_jsb_bf["gps_tile2latlng"]="// print @Tile2LatLng(187278, 378569, 20)\xFE//  { \"lngX\": -115.703201293945, \"latY\": 44.6664553391477 }\xFE//\xFEfunction gps_tile2LatLng(byval tile_x As Integer, byval tile_y As Integer, byval zoom As Integer) As Json\xFE    *$options async-\xFE    \xFE    Dim n As Single = PI() - ((2.0 * PI() * tile_y) / Pwr(2.0, zoom));\xFE    Dim lngX As Single = (tile_x / Pwr(2.0, zoom) * 360.0) - 180.0;\xFE    Dim latY As Single = 180.0 / PI() * ATan(SinH(n))\xFE    Dim A As Json = {a:[latY, lngX]}\xFE    return a.a\xFEend function";
