var z="function initBluetoothSerial()\xFE";
 z+="    $Options Js\xFE";
 z+="    $Options External bluetoothSerial\xFE";
 z+="    If !isBlueToothEnabled() Then \xFE";
 z+="        @Errors = \"Your bluetooth is disabled.  Please enable and restart this program. \"\xFE";
 z+="        Return False\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    If isBlueToothConnected() Then Return True\xFE";
 z+="    \xFE";
 z+="    ignoreDevice = \"\"\xFE";
 z+="    lastDevice = @Session(\"lastDevice\")\xFE";
 z+="    AutoAttach = True\xFE";
 z+="    \xFE";
 z+="    // get bonded list\xFE";
 z+="    bondedList = getBlueToothBondedList()\xFE";
 z+="    if IsNull(bondedList) Then Return False\xFE";
 z+="    \xFE";
 z+="    Loop\xFE";
 z+="        Od = []\xFE";
 z+="        Hc = []\xFE";
 z+="        bluetoothDevices = {}\xFE";
 z+="        \xFE";
 z+="        For Each Device, I In bondedList\xFE";
 z+="            DeviceName = Device.name\xFE";
 z+="            If DeviceName <> \"\" Then\xFE";
 z+="                If Left(DeviceName, 3) = \"HC-\" And DeviceName <> ignoreDevice Then Hc[-1] = DeviceName \xFE";
 z+="                Od[-1] = DeviceName\xFE";
 z+="                bluetoothDevices[DeviceName] = Device\xFE";
 z+="            End If\xFE";
 z+="        Next\xFE";
 z+="        \xFE";
 z+="        If !AutoAttach Or !Len(HC) Then\xFE";
 z+="            Print \"Searching for Unpaired Devices\"\xFE";
 z+="            @Server.FLush\xFE";
 z+="            deviceList = getBlueToothUnpairedList()\xFE";
 z+="            if IsNull(bondedList) Then Return False\xFE";
 z+="            \xFE";
 z+="            For Each Device, I In deviceList\xFE";
 z+="                DeviceName = Device.name\xFE";
 z+="                If DeviceName <> \"\" Then\xFE";
 z+="                    If LCase(Left(DeviceName, 3)) = \"hc-\" And DeviceName <> ignoreDevice Then locate DeviceName in HC Else Hc[-1] = DeviceName \xFE";
 z+="                    locate DeviceName in Od Else Od[-1] = DeviceName\xFE";
 z+="                    bluetoothDevices[DeviceName] = Device\xFE";
 z+="                End If\xFE";
 z+="            Next\xFE";
 z+="            \xFE";
 z+="            If Len(Hc) = 1 then AutoAttach = True\xFE";
 z+="        End If\xFE";
 z+="        \xFE";
 z+="        if lastDevice and bluetoothDevices[lastDevice] Then\xFE";
 z+="           DeviceName = lastDevice\xFE";
 z+="           lastDevice = \"\"\xFE";
 z+="\xFE";
 z+="        ElseIf Len(Hc) = 1 And AutoAttach Then\xFE";
 z+="            DeviceName = Hc[1]\xFE";
 z+="        Else\xFE";
 z+="            DeviceName = @Jsb_bf.inputComboBox(\"title\", \"Pick a device\", Od, \"\", 300, 300)\xFE";
 z+="            If DeviceName = \"\" Or DeviceName = Chr(27) Then @Errors = \"\"; Return False\xFE";
 z+="        End If\xFE";
 z+="        \xFE";
 z+="        Print \"Attempting connection to \":DeviceName\xFE";
 z+="        @Server.FLush\xFE";
 z+="        \xFE";
 z+="        DeviceProperties = bluetoothDevices[DeviceName]\xFE";
 z+="        \xFE";
 z+="    Until bluetoothConnect(DeviceProperties.address) Do\xFE";
 z+="        Print \"Connection failed to \":DeviceName\xFE";
 z+="        ignoreDevice = DeviceName\xFE";
 z+="        AutoAttach = False\xFE";
 z+="    Repeat\xFE";
 z+="    \xFE";
 z+="    @Session(\"lastDevice\") = DeviceName \xFE";
 z+="    \xFE";
 z+="    Return True\xFE";
 z+="end function"
window.cached_jsb_bf["initbluetoothserial"]=z;
