var z="'\xFE";
 z+="' Use the IOConv function to convert string to a specified storage format.\xFE";
 z+="'\xFE";
 z+="' IO:         is either \"I\" or \"O\" which signifies an input or output conversion.\xFE";
 z+="' CString:    is the string to be converted.\xFE";
 z+="' Conv:       is one or more valid conversion codes, separated by value\xFE";
 z+="'             marks (ASCII 253). Multiple codes are applied from left to right.\xFE";
 z+="'             The first conversion code converts the value of CString.  The second\xFE";
 z+="'             conversion code converts the output of the first conversion, and so on.\xFE";
 z+="'\xFE";
 z+="' CString with the null value returns null. Conversion with the null value\xFE";
 z+="' results in program termination and a run-time error.\xFE";
 z+="'\xFE";
 z+="' The @STATUS variable reflects the result of the conversion:\xFE";
 z+="'    0 - Successful conversion\xFE";
 z+="'    1 - String is invalid.\xFE";
 z+="'    An empty string returns, unless string is the null value.\xFE";
 z+="'    2 - Invalid conversion\xFE";
 z+="'    3 - Successful conversion of possibly invalid data\xFE";
 z+="'\xFE";
 z+="'   MCU     - upper case string\xFE";
 z+="'   MCL     - lower case string\xFE";
 z+="'   MCA     - strip all but Alpha chars\xFE";
 z+="'   MC/A    - strip all Alpha chars\xFE";
 z+="'   MCD     - Input: Convert Hex to Dec | Output: Convert Dec to Hex\xFE";
 z+="'   MCX     - Input: Convert Dec to Hex | Output: Convert Hex to Dec\xFE";
 z+="'   MCN     - Strip all but digits - including periods\xFE";
 z+="'   MC/N    - strip all digits\xFE";
 z+="'   MCP     - Strip non printing chars\xFE";
 z+="'   MCT     - convert string to Title format (upcase first letters)\xFE";
 z+="'   MX or MP- Output: Convert STRING to hex string | Input: Convert hex string to STRING\xFE";
 z+="'   MTn     - Output: Convert internal time to String (MT, MTS, MTH, MTHS) | Input: Convert string to internal time \xFE";
 z+="'   Mn      - Output: masked format\xFE";
 z+="'   XTD     - Convert hex to decimal\xFE";
 z+="'   DTX     - Convert decimal to hex\xFE";
 z+="'   Dn      - Output: convert internal date to string | Input: convert string to internal date\xFE";
 z+="'   U201E   - return count of field marks in string\xFE";
 z+="'   U80E0   - turn echo off\xFE";
 z+="'   U70E0   - turn echo on\xFE";
 z+="'   t#{,#}    - Text Extract (Mid(0 function)\xFE";
 z+="'   t{dict }file;[c,i,o,v,x]{[vc|*]}; inac;outac\xFE";
 z+="'      CString is ITEMID - c) Return conversion or CString if empty or not found, v) Return ItemID else Error if not found x), Return Conversion or NULL, i) if iconv return itemid or err, if oconv return conversion or CString if empty or not found\xFE";
 z+="'\xFE";
 z+="Function IOConv(ByVal IO As String, ByVal CString As String, ByVal Conv As String, optional ByVal LR As String, optional ByVal IOCache As JSON)\xFE";
 z+="    * $options aspxc-\xFE";
 z+="    \xFE";
 z+="    Dim CACHEDTRANSLATES As JSON\xFE";
 z+="    Dim NUMAMC As Boolean\xFE";
 z+="    Dim ILEN As Integer\xFE";
 z+="    Dim DOCAP As Integer\xFE";
 z+="    Dim SECS As Integer\xFE";
 z+="    Dim MINS As Integer\xFE";
 z+="    Dim CMDI As Integer\xFE";
 z+="    Dim STARTI As Integer\xFE";
 z+="    Dim CI As Integer\xFE";
 z+="    Dim NOTFOUND As Integer\xFE";
 z+="    Dim SUBVALUE As Integer\xFE";
 z+="    Dim SCALEFACTOR As Integer\xFE";
 z+="    Dim IAMC As Integer\xFE";
 z+="    Dim RESULT As Variant\xFE";
 z+="    Dim SL As SelectList\xFE";
 z+="    Dim HOURS As Single\xFE";
 z+="    Dim F As Single\xFE";
 z+="    Dim CMD As String\xFE";
 z+="    Dim SCMD As String\xFE";
 z+="    Dim MX As String\xFE";
 z+="    Dim PAT As String\xFE";
 z+="    Dim SIGNCODE As String\xFE";
 z+="    Dim CMDC As String\xFE";
 z+="    Dim C As String\xFE";
 z+="    Dim SEP As String\xFE";
 z+="    Dim THEDAY As String\xFE";
 z+="    Dim THEYEAR As String\xFE";
 z+="    Dim THEMONTHNAME As String\xFE";
 z+="    Dim YYTYPE As StRiNg\xFE";
 z+="    Dim YYTEXT As String\xFE";
 z+="    Dim RANGE1 As StRiNg\xFE";
 z+="    Dim DDATA As String\xFE";
 z+="    Dim FNAME As StRiNg\xFE";
 z+="    Dim CCODE As String\xFE";
 z+="    Dim OAMC As StRiNg\xFE";
 z+="    Dim AMC As String\xFE";
 z+="    Dim CCODE1 As StRiNg\xFE";
 z+="    Dim CACHEID As String\xFE";
 z+="    Dim WHERECLAUSE As String\xFE";
 z+="    Dim ITEMID As StRiNg\xFE";
