 z+="    Dim THEMONTH As StriNg\xFE";
 z+="\xFE";
 z+="    EQU V_STR TO 1\xFE";
 z+="    EQU V_IDENT TO 2\xFE";
 z+="    EQU V_NUM TO 3\xFE";
 z+="    EQU V_EOL TO 4\xFE";
 z+="    EQU V_SYM TO 5\xFE";
 z+="    \xFE";
 z+="    @Status = Nothing\xFE";
 z+="\xFE";
 z+="    if IOCache Then\xFE";
