 z+="                            Result[-1] = MX\xFE";
 z+="                        ElseIf MX >= \"a\" And MX <= \"z\" Then\xFE";
 z+="                            Result[-1] = MX\xFE";
 z+="                        End If\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="                Case Cmd = \"MC/A\"\xFE";
 z+="                    For Idx = 1 To ILen\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        If MX >= \"A\" And MX <= \"Z\" Then\xFE";
 z+="                        ElseIf MX >= \"a\" And MX <= \"z\" Then\xFE";
 z+="                        Else\xFE";
 z+="                            Result[-1] = MX\xFE";
 z+="                        End If\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="                Case Cmd = \"MCD\"\xFE";
 z+="                    If IO = \"I\" Then\xFE";
 z+="                        Return XTD(CString)\xFE";
 z+="                    ElseIf IsNumeric(CString) Then\xFE";
 z+="                        Return DTX(CString)\xFE";
 z+="                    Else\xFE";
 z+="                        @Status = 1\xFE";
 z+="                    End If\xFE";
 z+="                Case Cmd = \"MCX\" Or Cmd = \"MCXD\"\xFE";
 z+="                    If IO = \"O\" Then\xFE";
 z+="                        Return XTD(CString)\xFE";
 z+="                    ElseIf IsNumeric(CString) Then\xFE";
 z+="                        Return DTX(CString)\xFE";
 z+="                    Else\xFE";
 z+="                        @Status = 1\xFE";
 z+="                    End If\xFE";
 z+="                Case Cmd = \"MCN\"\xFE";
 z+="                    For Idx = 1 To ILen\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        If IsNumeric(MX) Then Result[-1] = MX\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="                Case Cmd = \"MC/N\"\xFE";
 z+="                    For Idx = 1 To ILen\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        If IsNumeric(MX) = 0 Then\xFE";
 z+="                            Result[-1] = MX\xFE";
 z+="                        End If\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="                Case Cmd = \"MCP\"\xFE";
 z+="                    For Idx = 1 To ILen\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        If Asc(MX) > 250 Then\xFE";
 z+="                            MX = Chr(Asc(MX) - 254 + Asc(\"^\"))\xFE";
 z+="                        ElseIf Asc(MX) <= 31 Or Asc(MX) > 127 Then\xFE";
 z+="                            MX = \".\"\xFE";
 z+="                        End If\xFE";
 z+="                        Result[-1] = MX\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="                Case Cmd = \"MCT\"\xFE";
 z+="                    DoCap = 1\xFE";
 z+="                    For Idx = 1 To ILen\xFE";
 z+="                        MX = Mid$(CString, Idx, 1)\xFE";
 z+="                        If (MX >= \"a\" And MX <= \"z\") Then\xFE";
 z+="                            If DoCap Then MX = UCase$(MX)\xFE";
 z+="                            DoCap = 0\xFE";
 z+="                        ElseIf MX = \" \" Then\xFE";
 z+="                            DoCap = 1\xFE";
 z+="                        Else\xFE";
 z+="                            If DoCap = 0 Then MX = LCase$(MX)\xFE";
 z+="                            DoCap = 0\xFE";
 z+="                        End If\xFE";
 z+="                        Result[-1] = MX\xFE";
 z+="                    Next Idx\xFE";
 z+="                    Return Join(Result, '')\xFE";
 z+="            End Select\xFE";
 z+="         \xFE";
 z+="        Case (Cmd = \"MX\") Or (Cmd = \"MP\")\xFE";
 z+="            If ILen = 0 Then\xFE";
 z+="                @Status = 1\xFE";
 z+="                Return Nothing\xFE";
 z+="            End If\xFE";
 z+="            If IO = \"O\" Then Return STX(CString) Else Return XTS(CString)\xFE";
 z+="\xFE";
 z+="        Case Left(Cmd, 2) = \"MT\"\xFE";
 z+="            If IO = \"O\" Then\xFE";
 z+="                If IsNumeric(CString) = 0 Then\xFE";
 z+="                    @Status = 1\xFE";
 z+="                    Return Nothing\xFE";
 z+="                End If\xFE";
 z+="                Secs = CString Mod 60\xFE";
 z+="                Hours = CInt(CString / 60)\xFE";
 z+="                Mins = Hours Mod 60\xFE";
 z+="                Hours = CInt(Hours / 60)\xFE";
 z+="                Hours = Hours Mod 24\xFE";
 z+="                If InStr(UCase(Conv), \"H\") Then\xFE";
 z+="                    If Hours < 13 Then\xFE";
 z+="                        Pat = \"AM\"\xFE";
 z+="                    Else\xFE";
 z+="                        Pat = \"PM\"\xFE";
 z+="                        Hours = Hours - 12\xFE";
 z+="                    End If\xFE";
 z+="                End If\xFE";
 z+="                If InStr(UCase(Conv), \"S\") Then\xFE";
 z+="                    Return Right(\"00\":Hours, 2):\":\":Right(\"00\":Mins, 2):\":\":Right(\"00\":Secs, 2):Pat\xFE";
 z+="                Else\xFE";
 z+="                    Return Right(\"00\":Hours, 2):\":\":Right(\"00\":Mins, 2):Pat\xFE";
 z+="                End If\xFE";
 z+="            Else\xFE";
 z+="                Return Time(CString) * 60 * 60 * 24\xFE";
 z+="            End If\xFE";
 z+="            \xFE";
 z+="        Case (SCmd = \"M\") And (IO = \"O\")\xFE";
 z+="            Return CStr(Fmt(CString, Conv))\xFE";
 z+="         \xFE";
 z+="        Case SCmd = \"M\" ;* IO = \"I\"\xFE";
 z+="            ScaleFactor = 0\xFE";
 z+="            SignCode = \" \"\xFE";
 z+="            CmdI = 2\xFE";
 z+="\xFE";
 z+="            CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            If ((CmdC = \"L\") Or (CmdC = \"R\")) Or (CmdC = \"D\") Then\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="            If IsNumeric(CmdC) And (CmdC <> \"\") Then\xFE";
 z+="                ScaleFactor = -CInt(CmdC)\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If IsNumeric(CmdC) And (CmdC <> \"\") Then\xFE";
 z+="                ScaleFactor = ScaleFactor * 2\xFE";
 z+="                ScaleFactor = ScaleFactor - (CInt(CmdC) - 4)\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If CmdC = \"Z\" Then\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="            If CmdC = \",\" Then\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="            If InStr(\" CDEM\", CmdC) > 1 Then\xFE";
 z+="                SignCode = CmdC\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="            If CmdC = \"$\" Then\xFE";
 z+="                CmdI = CmdI + 1\xFE";
 z+="                CmdC = CStr(UCase(Mid$(Cmd, CmdI, 1)))\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            Idx = 1\xFE";
 z+="            Loop While InStr(\"!0$* <\", Mid$(CString, Idx, 1)) > 1 Do\xFE";
 z+="                Idx = Idx + 1\xFE";
 z+="            Repeat\xFE";
 z+="            StartI = Idx\xFE";
 z+="            If (Mid$(CString, Idx, 1) = \"-\") Or (Mid$(CString, Idx, 1) = \"+\") Then Idx = Idx + 1\xFE";
 z+="            Loop C = Mid$(CString, Idx, 1) While IsNumeric(C) AND C <> \"\" Do\xFE";
 z+="                Idx = Idx + 1\xFE";
 z+="            Repeat\xFE";
 z+="            If Mid$(CString, Idx, 1) = \".\" Then Idx = Idx + 1\xFE";
 z+="            Loop C = Mid$(CString, Idx, 1) While IsNumeric(C) AND C <> \"\" Do\xFE";
 z+="                Idx = Idx + 1\xFE";
 z+="            Repeat\xFE";
 z+="            F = CNum(Mid$(CString, StartI, Idx - StartI))\xFE";
 z+="            CmdC = Mid$(CString, Idx, 1)\xFE";
 z+="            If CmdC = \"C\" Then F = -F\xFE";
 z+="            If CmdC = \">\" Then F = -F\xFE";
 z+="            If CmdC = \"-\" Then F = -F\xFE";
 z+="            If ScaleFactor Then F = F * 10 ^ (-ScaleFactor)\xFE";
 z+="         \xFE";
 z+="            If SignCode = \"D\" Then\xFE";
 z+="                If CmdC <> \"D\" Then F = -F\xFE";
 z+="                Return F:\"DB\":Mid$(CString, Idx)\xFE";
 z+="            End If\xFE";
 z+="         \xFE";
 z+="            Return F:Mid$(CString, Idx)\xFE";
 z+="         \xFE";
 z+="        Case Cmd = \"XTD\"\xFE";
 z+="            Return Xtd(CString)\xFE";
 z+="\xFE";
 z+="        Case Cmd = \"DTX\"\xFE";
 z+="            If IsNumeric(CString) Then RETURN DTX(CString)\xFE";
 z+="         \xFE";
 z+="        Case SCmd = \"D\"\xFE";
 z+="            If IO = \"O\" And Cmd <> \"DI\" Then\xFE";
 z+="                If IsNumeric(CString) = False Then\xFE";
 z+="                    @Status = 1\xFE";
 z+="                    Return Nothing\xFE";
 z+="                End If\xFE";
 z+="                If Left(Cmd,2) = \"DY\" Then Conv = Mid$(Conv, 2)\xFE";
 z+="            \xFE";
 z+="                TheYearLength = Mid$(Conv, 2, 1)\xFE";
 z+="                If IsNumeric(TheYearLength) And TheYearLength <> \"\" Then\xFE";
 z+="                    TheYearLength = CInt(Mid$(Conv, 2, 1))\xFE";
 z+="                    Sep = Mid$(Conv, 3, 1)\xFE";
 z+="                Else\xFE";
 z+="                    TheYearLength = 4\xFE";
 z+="                    Sep = Mid$(Conv, 2, 1)\xFE";
 z+="                End If\xFE";
 z+="\xFE";
 z+="                TD = Val(CString)\xFE";
 z+="                TheDay = @theDay(TD)\xFE";
 z+="                If Len(TheDay) = 1 Then TheDay = \"0\":TheDay \xFE";
 z+="                TheYear = @theYear(TD)\xFE";
 z+="                TheMonth = @theMonth(TD)\xFE";
 z+="                If Len(TheMonth) = 1 Then TheMonth = \"0\":TheMonth\xFE";
 z+="            \xFE";
 z+="                Select Case 1\xFE";
 z+="                    Case Cmd = \"DD\"\xFE";
 z+="                        Return TheDay\xFE";
 z+="                    Case Cmd = \"DJ\"\xFE";
 z+="                        Return TD - Date(\"1/1/\":TheYear)\xFE";
 z+="                    Case Cmd = \"DM\"\xFE";
 z+="                        Return TheMonth\xFE";
 z+="                    Case Cmd = \"DMA\"\xFE";
 z+="                        Return UCase(Left(@theMonthName(TD), 3))\xFE";
 z+="                    Case Cmd = \"DQ\"\xFE";
 z+="                        Return CInt((TheMonth - 1) / 3 + 1)\xFE";
 z+="                    Case Cmd = \"DW\" ;* Numeric day of the week\xFE";
 z+="                        Idx = Dow(TD)\xFE";
 z+="                        If Idx = 0 Then Idx = 7\xFE";
 z+="                        return Idx\xFE";
 z+="                    Case Cmd = \"DWA\"\xFE";
 z+="                        Return UCase(theWeekDay(TD))\xFE";
 z+="                    Case Left(Cmd, 2) = \"DY\"\xFE";
 z+="                        Return Right(TheYear, TheYearLength)\xFE";
 z+="                    Case 1\xFE";
 z+="                        If Sep = \"\" Then\xFE";
 z+="                            TheMonthName = UCase$(@theMonthName(TD))\xFE";
 z+="                            Return TheDay:\" \":Mid$(TheMonthName, 1, 3):Mid$(\" \", 1, TheYearLength):Right(TheYear, TheYearLength)\xFE";
 z+="                        Else\xFE";
 z+="                            Return TheDay:Sep:TheMonth:Mid$(Sep, 1, TheYearLength):Right(TheYear, TheYearLength)\xFE";
 z+="                        End If\xFE";
 z+="                End Select\xFE";
 z+="            Else\xFE";
 z+="            ' ICONV ON DATE\xFE";
 z+="                If IsNumeric(CString) Then Return CString Else Return Date(CString)\xFE";
 z+="            End If\xFE";
 z+="         \xFE";
 z+="        Case Cmd = \"U50BB\"\xFE";
 z+="            Return Who()\xFE";
 z+="        \xFE";
 z+="        Case Cmd = \"U80E0\"\xFE";
 z+="            ECHO OFF\xFE";
 z+="         \xFE";
 z+="        Case Cmd = \"U70E0\"\xFE";
 z+="            ECHO ON\xFE";
 z+="\xFE";
 z+="        Case SCmd = \"T\" \xFE";
 z+="            CI = 2 ;* Skip T\xFE";
 z+="            Result = \"\"\xFE";
 z+="            YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="            IF YYTEXT = \";\" THEN YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="            @ERRORS = \"\"\xFE";
 z+="            \xFE";
 z+="            // Simple Text Extraction (Mid(RANGE1, n) ?)\xFE";
 z+="            IF YYTYPE = V_NUM THEN\xFE";
 z+="                RANGE1 = YYTEXT\xFE";
 z+="                IF CONV[CI,1] = \",\" THEN\xFE";
 z+="                    YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="                    YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="                    IF YYTYPE <> V_NUM THEN\xFE";
 z+="                        @ERRORS = \"Tm,n: Text extraction: Missing length\"\xFE";
 z+="                        RETURN @ERRORS\xFE";
 z+="                    END\xFE";
 z+="                    \xFE";
 z+="                    IOCache.preParse = \"TextExtraction2\"\xFE";
 z+="                    IOCache.Range1 = RANGE1\xFE";
 z+="                    IOCache.Range2 = YYTEXT\xFE";
 z+="                Else\xFE";
 z+="                    IOCache.Length = YYTEXT\xFE";
 z+="                    IF LR = \"R\" THEN IOCache.preParse = \"TextExtractionR\" Else IOCache.preParse = \"TextExtractionL\"\xFE";
 z+="                end if\xFE";
 z+="                Goto preParsed\xFE";
 z+="            END IF\xFE";
 z+="        \xFE";
 z+="            // Note that CString is the ITEMID for the file\xFE";
 z+="            \xFE";
 z+="            // t{DICT }\xFE";
 z+="            IF YYTEXT = \"DATA\" OR YYTEXT = \"DICT\" THEN\xFE";
 z+="                DDATA = YYTEXT\xFE";
 z+="                YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="                IF YYTYPE <> V_IDENT THEN\xFE";
 z+="                    @ERRORS = \"Tfile;c;iamc;oamc: Missing file name\"\xFE";
 z+="                    RETURN @ERRORS\xFE";
 z+="                END\xFE";
 z+="            END ELSE\xFE";
 z+="                DDATA = \"\"\xFE";
 z+="            END\xFE";
 z+="            \xFE";
 z+="            // t{DICT }file\xFE";
 z+="            IF YYTYPE <> V_IDENT THEN\xFE";
 z+="                @ERRORS = \"Bad Text extract: Tn, or bad translate: Tfile;c;iamc;oamc\"\xFE";
 z+="                RETURN @ERRORS\xFE";
 z+="            END IF\xFE";
 z+="            FNAME = YYTEXT\xFE";
 z+="            \xFE";
 z+="            YYTEXT = CONV[CI,1] ; CI = CI + 1\xFE";
 z+="            IF YYTEXT <> \";\" AND YYTEXT <> \"\" THEN\xFE";
 z+="                @ERRORS = \"Tfile;c;iamc;oamc: Translate missing ;\"\xFE";
 z+="                RETURN @ERRORS\xFE";
 z+="            END IF\xFE";
 z+="            \xFE";
 z+="            // t{DICT }file{ ;[c,i,o,v,x]}\xFE";
 z+="            YYTEXT = UCASE(CONV[CI, 1]) \xFE";
 z+="            IF INDEX(\"VCIOX\", YYTEXT,1) AND CONV[CI+1, 1] = \";\" THEN\xFE";
 z+="                CI = CI + 1\xFE";
 z+="                IF YYTEXT = \"C\" AND NUM(CONV[CI,1]) THEN\xFE";
 z+="                    YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)\xFE";
 z+="                    CCODE = \"C\":YYTEXT\xFE";
 z+="                END\xFE";
 z+="                CCODE = UCASE(YYTEXT)  \xFE";
 z+="            ELSE\xFE";
 z+="                CCODE = \"X\"\xFE";
 z+="            END IF\xFE";
 z+="            \xFE";
 z+="            YYTEXT = CONV[CI,1] \xFE";
 z+="            IF YYTEXT = \";\" THEN CI = CI + 1\xFE";
 z+="            \xFE";
 z+="            // t{DICT }file;[c,i,o,v,x]{[vc|*]}; iamc\xFE";
 z+="            YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)                 ; * Get iamc\xFE";
 z+="            IF YYTEXT = \";\" OR YYTEXT = \"\" THEN\xFE";
 z+="                IAMC = 1 \xFE";
 z+="                IF IO = \"I\" Then IOCache.preParse = \"returnCString\"; Goto preParsed\xFE";
 z+="                \xFE";
 z+="            END ELSE\xFE";
 z+="                IAMC = YYTEXT\xFE";
 z+="                YYTEXT = CONV[CI,1] ; CI = CI + 1\xFE";
 z+="            END IF\xFE";
 z+="            \xFE";
 z+="            IF YYTEXT = \";\" THEN\xFE";
 z+="                YYTYPE = ICONV_Lex(CONV, CI, YYTEXT)                 ; * Get oamc\xFE";
 z+="                IF YYTEXT = \";\" THEN\xFE";
 z+="                    IF IO = \"O\" THEN IOCache.preParse = \"returnCString\"; Goto preParsed\xFE";
 z+="                    \xFE";
 z+="                END ELSE\xFE";
 z+="                    OAMC = YYTEXT\xFE";
 z+="                    YYTEXT = CONV[CI,1] ; CI = CI + 1\xFE";
 z+="                END IF\xFE";
 z+="            ELSE\xFE";
 z+="                OAMC = IAMC\xFE";
 z+="            END IF\xFE";
 z+="            \xFE";
 z+="            RESULT = \"\" ; NOTFOUND = 1\xFE";
 z+="            \xFE";
 z+="            \xFE";
 z+="            IF IO = \"I\" THEN AMC = IAMC ELSE AMC = OAMC\xFE";
 z+="            NUMAMC = ISNUM(AMC)\xFE";
 z+="            \xFE";
 z+="            // Pick up Cache\xFE";
 z+="            IOCache.preParse = \"TextTranslate\"\xFE";
 z+="            IOCache.AMC = AMC\xFE";
 z+="            IOCache.OAMC = OAMC\xFE";
 z+="            IOCache.IAMC = IAMC\xFE";
 z+="            IOCache.DDATA = DDATA\xFE";
 z+="            IOCache.FNAME = FNAME\xFE";
 z+="            IOCache.NUMAMC = NUMAMC\xFE";
 z+="            IOCache.CachedTranslates = {}\xFE";
 z+="            IOCache.CCODE = CCODE\xFE";
 z+="            IOCache.CCODE1 = LEFT(CCODE, 1)\xFE";
 z+="            IOCache.SubValue = MID(CCODE, 2)\xFE";
 z+="            \xFE";
 z+="TextTranslate:\xFE";
 z+="            OAMC = IOCache.OAMC\xFE";
 z+="            AMC = IOCache.AMC\xFE";
 z+="            IAMC = IOCache.IAMC\xFE";
 z+="            DDATA = IOCache.DDATA\xFE";
 z+="            FNAME = IOCache.FNAME\xFE";
 z+="            NUMAMC = IOCache.NUMAMC\xFE";
 z+="            CCODE = IOCache.CCODE\xFE";
 z+="            CCODE1 = IOCache.CCODE1\xFE";
 z+="            SubValue = IOCache.SubValue\xFE";
 z+="            \xFE";
 z+="            OPEN DDATA, FNAME TO F_FILE ELSE RETURN @ERRORS\xFE";
 z+="            \xFE";
 z+="            CachedTranslates = IOCache.CachedTranslates\xFE";
 z+="\xFE";
 z+="            CacheID = LCase(IO:\"*\":DDATA:\"*\":FNAME:\"*\":CString:\"*\":AMC)\xFE";
 z+="            RESULT = CachedTranslates[CacheID] \xFE";
 z+="\xFE";
 z+="            // Read Result if necessary\xFE";
 z+="            IF isMissing(RESULT) THEN \xFE";
 z+="                If IO = \"O\" THEN\xFE";
 z+="                    IF NUMAMC THEN\xFE";
 z+="                        READV RESULT FROM F_FILE, CString, OAMC ELSE RESULT = Null\xFE";
 z+="                    END ELSE\xFE";
 z+="                        READJSON RESULT FROM F_FILE, CString THEN RESULT = RESULT[OAMC] ELSE RESULT = Null\xFE";
 z+="                    END\xFE";
 z+="                Else\xFE";
 z+="                    // Select F_File Where AMC = CString Return ItemID\xFE";
 z+="                    IF NUMAMC THEN WhereClause = \"*A\":IAMC:\" = '\":CString:\"'\" ELSE WhereClause = IAMC:\" = '\":CString:\"'\"\xFE";
 z+="                    Select F_File Where WhereClause  To SL Then\xFE";
 z+="                        ReadNext ItemID From SL Then Result = ItemID Else Result = Null\xFE";
 z+="                    Else\xFE";
 z+="                        Result = Null\xFE";
 z+="                    End If\xFE";
 z+="                END IF\xFE";
 z+="                IF !isMissing(Result) Then\xFE";
 z+="                    CachedTranslates[CacheID] = RESULT\xFE";
 z+="                    ' IOCache.CachedConvCachedTranslates = CachedTranslates\xFE";
 z+="                END IF \xFE";
 z+="            END IF\xFE";
 z+="\xFE";
 z+="\xFE";
 z+="            BEGIN CASE\xFE";
 z+="                CASE CCODE1 = \"V\" OR (CCODE = \"I\" AND IO = \"I\") OR (CCODE = \"O\" AND IO = \"O\")\xFE";
 z+="                    IF Len(Result) = 0 THEN\xFE";
 z+="                        @Errors = \"Missing T Conversion Item, not on file: \":DDATA:\" \":FNAME:\" \":CString:\", \":OAMC\xFE";
 z+="                        Return @Errors\xFE";
 z+="                    END IF\xFE";
 z+="                    Return CString\xFE";
 z+="                    \xFE";
 z+="                CASE CCODE1 = \"C\" OR (CCODE = \"I\" AND IO = \"O\") OR (CCODE = \"O\" AND IO = \"I\")\xFE";
 z+="                    IF Len(Result) = 0 THEN Result = CString\xFE";
 z+="            END CASE\xFE";
 z+="                \xFE";
 z+="            // SubValue??\xFE";
 z+="            IF SubValue THEN Return RESULT<1,SubValue>\xFE";
 z+="            Return RESULT\xFE";
 z+="        \xFE";
 z+="        Case Else\xFE";
 z+="            @Status = 2\xFE";
 z+="            Return CString\xFE";
 z+="    End Select\xFE";
 z+="    \xFE";
 z+="    return \"\"\xFE";
 z+="end function\xFE";
 z+="\xFE";
 z+="function ICONV_Lex(CONV As String, CI As Integer, YYTEXT As String) As Integer\xFE";
 z+="    * $options aspxc-\xFE";
 z+="  \xFE";
 z+="    * LEX - Return YYTYPE (V_Str, V_Num, V_Ident, V_Sym), YYText\xFE";
 z+="    Dim CH As String\xFE";
 z+="    Dim ECH As StRiNg\xFE";
 z+="\xFE";
 z+="    EQU V_STR TO 1\xFE";
 z+="    EQU V_IDENT TO 2\xFE";
 z+="    EQU V_NUM TO 3\xFE";
 z+="    EQU V_EOL TO 4\xFE";
 z+="    EQU V_SYM TO 5\xFE";
 z+="    \xFE";
 z+="    CH = CONV[CI, 1]\xFE";
 z+="    CI = CI + 1\xFE";
 z+="    YYTEXT = CH\xFE";
 z+="    IF CH = \"\" THEN Return V_EOL\xFE";
 z+="    *\xFE";
 z+="    * Check for a string\xFE";
 z+="    IF CH = \"'\" OR CH = '\"' OR CH = `\\` THEN\xFE";
 z+="        ECH = CH\xFE";
 z+="        YYTEXT = CH\xFE";
 z+="        LOOP\xFE";
 z+="            CH = CONV[CI,1]\xFE";
 z+="            CI = CI + 1\xFE";
 z+="            YYTEXT = YYTEXT:CH\xFE";
 z+="        UNTIL CH = \"\" OR CH = ECH DO REPEAT\xFE";
 z+="        Return V_STR\xFE";
 z+="    END IF\xFE";
 z+="    *\xFE";
 z+="    * Check for a number\xFE";
