 z+="            Else If Left(Param, 1) = \"{\" Then\xFE";
 z+="                Url := Param\xFE";
 z+="            Else\xFE";
 z+="                Url := \"{\":Param:\"}\" ;* Assume post back form id\xFE";
 z+="            End If\xFE";
 z+="        Next\xFE";
 z+="        \xFE";
 z+="        return Url\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    If System(1) = \"js\" Then\xFE";
