 z+="function leaflet_makeTiles() As Boolean\xFE";
 z+="    $Options Js\xFE";
 z+="    $Include __leafLet\xFE";
 z+="    \xFE";
 z+="    Kilo = 1024\xFE";
 z+="    Mega = Kilo * Kilo\xFE";
 z+="    GigaByte =  Mega * Kilo\xFE";
 z+="    \xFE";
 z+="    If !leaflet_OpenTileCaches(f_tmpTileCache, f_TileCache) Then Return False\xFE";
 z+="    \xFE";
 z+="    Print @(-1):\"Selecting your tmpTileCache\"; @Server.Flush\xFE";
 z+="    \xFE";
 z+="    Select f_tmpTileCache To Sl Else Return Alert(@Errors)\xFE";
 z+="    \xFE";
 z+="    Allids = Getlist(Sl)\xFE";
 z+="    Sl = \"\"\xFE";
 z+="    AllIdCnt = UBound(Allids)\xFE";
 z+="    \xFE";
 z+="    If !AllIdCnt Then\xFE";
 z+="        MsgBox(\"There are no tiles in your tmpTileCache. Go make some! (Run a leaflet enabled map at the highest magnification, or run getAllTiles)\")\xFE";
 z+="        Return True\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Print @(-1):\"Making \":AllIdCnt * 2:\" higher level tiles for your TileCache\"\xFE";
 z+="\xFE";
 z+="    Print @ProgressBar('progressBarID', { style: 'position: absolute; width: 60%; top: 50%; left: 20%;' } ):\xFE";
 z+="    \xFE";
 z+="    @Server.Flush\xFE";
 z+="    \xFE";
 z+="    updateProgressBar('progressBarID', 0, 1, UBound(Allids) ) ;* updateProgressBar(Byval Id, Byval ValueNow, Byval ValueMin, Byval ValueMax, Optional Byval Animate)\xFE";
 z+="    \xFE";
 z+="    Level19IDs = []\xFE";
 z+="    Level6 = []      // level 7 really only needs to be done once, but doesn't hurt to copy again\xFE";
 z+="    \xFE";
 z+="    For Each Id, Idi In Allids\xFE";
 z+="        ' id is ifwis_z19_y191454_x92927.png\xFE";
 z+="        S = Split(Id, \"_\")\xFE";
 z+="        Z = Val(Mid(S[2], 2))\xFE";
 z+="        Y = Val(Mid(S[3], 2))\xFE";
 z+="        X = Val(Mid(S[4], 2))\xFE";
 z+="        \xFE";
 z+="        // Put into f_TileCache if not already there\xFE";
 z+="        If Z = 7 Or Z = 19 Then\xFE";
 z+="            Read TileAlreadyThere From f_TileCache, Id Else\xFE";
 z+="                Read Tile From f_tmpTileCache, Id Else Return Alert(@Errors)\xFE";
 z+="                \xFE";
 z+="                leaflet_cacheWriteTile(f_TileCache, X, Y, Z, Tile)\xFE";
 z+="                \xFE";
 z+="                If Z = 19 Then\xFE";
 z+="                    Level19IDs[-1] = Id\xFE";
 z+="                ElseIf Z = 7 Then\xFE";
 z+="                    Level6[-1] = Id\xFE";
 z+="                End If\xFE";
 z+="            End If\xFE";
 z+="        End If\xFE";
 z+="        updateProgressBar('progressBarID', \"Copying detail tiles \":Idi:\" of \":UBound(Allids), 1, UBound(Allids) )\xFE";
 z+="    Next\xFE";
 z+="\xFE";
 z+="    // Compute and write tiles from level 19 upto level 7\xFE";
 z+="    Idcnt = UBound(Level19IDs)\xFE";
 z+="    Lp = 0\xFE";
 z+="    For Level = 18 To 7 Step - 1\xFE";
 z+="        For Each Id, Idi In Level19IDs\xFE";
 z+="\xFE";
 z+="            ' id is ifwis_z19_y191454_x92927.png\xFE";
 z+="            S = Split(Id, \"_\")\xFE";
 z+="            Z = Val(Mid(S[2], 2))\xFE";
 z+="            Y = Val(Mid(S[3], 2))\xFE";
 z+="            X = Val(Mid(S[4], 2))\xFE";
 z+="            \xFE";
 z+="            For Z = Z-1 To 7 Step -1\xFE";
 z+="                ' Compute my parent (Z-1)\xFE";
 z+="                X = CInt(X / 2)\xFE";
 z+="                Y = CInt(Y / 2)\xFE";
 z+="                If Z = Level Then\xFE";
 z+="                    Np = Level:\".\":Left(Field(1-(Idi/idcnt), '.', 2), 2)\xFE";
 z+="                    If Np <> Lp Then\xFE";
 z+="                        updateProgressBar('progressBarID', \"Building Level \":Np:\" from children\", 7, 19 )\xFE";
 z+="                        Lp = Np\xFE";
 z+="                    End If\xFE";
 z+="                    \xFE";
 z+="                    If Z = 7 Then\xFE";
 z+="                        cacheID = leaflet_CacheID(X, Y, Z)\xFE";
 z+="                        Locate cacheID In Level6 Else Level6[-1] = cacheID\xFE";
 z+="                    Else\xFE";
 z+="                        If !leaflet_cacheReadTile(f_TileCache, Null, X, Y, Z, True, Tile) Then\xFE";
 z+="                            leaflet_buildTileFromChildren(f_TileCache, Null, X, Y, Z) ;* Puts Everything In Cache\xFE";
 z+="                        End If\xFE";
 z+="                    End If\xFE";
 z+="                    \xFE";
 z+="                    Break\xFE";
 z+="                End If\xFE";
 z+="            Next\xFE";
 z+="        Next\xFE";
 z+="    Next\xFE";
 z+="\xFE";
 z+="    // Rebuild all level 7\xFE";
 z+="    Idcnt = UBound(Level6)\xFE";
 z+="    For Each Id, Idi In Level6\xFE";
 z+="        updateProgressBar('progressBarID', \"Building level Six \":Idi, 1, Idcnt )\xFE";
 z+="\xFE";
 z+="        S = Split(Id, \"_\")\xFE";
 z+="        Z = Val(Mid(S[2], 2))\xFE";
 z+="        Y = Val(Mid(S[3], 2))\xFE";
 z+="        X = Val(Mid(S[4], 2))\xFE";
 z+="        \xFE";
 z+="        leaflet_buildTileFromChildren(f_TileCache, Null, X, Y, Z) ;* Puts Everything In Cache\xFE";
 z+="    Next\xFE";
 z+="    \xFE";
 z+="    Clearfile f_tmpTileCache Else Return Alert( @Errors )\xFE";
 z+="    $('#progressBarID').remove()\xFE";
 z+="    \xFE";
 z+="    Return True\xFE";
 z+="End function"
