window.cached_jsb_bf["leaflet_metersperpixel"]="function leaflet_metersPerPixel()\xFE    *$options js\xFE    *$options async-\xFE    *$options external L, map\xFE    *$options internal firstPoint\xFE    mapHeight = Map.getSize().y ;* this Is The Screen Height Of The Map\xFE    mapWidth = Map.getSize().x ;* this Is The Screen Width Of The Map\xFE    \xFE    // calculate the distance the one side of the map to the other using the haversine formula\xFE    firstPoint = leaflet_mapPixelToLatLong(0, mapHeight)\xFE    MapWidthMeters = firstPoint.distanceTo( leaflet_mapPixelToLatLong(mapWidth, mapHeight) )\xFE    \xFE    // calculate how many meters each pixel represents\xFE    Return MapWidthMeters/mapWidth\xFEEnd function";
