window.cached_jsb_bf["leaflet_tile2latlng"]="// print @Tile2LatLng(187278, 378569, 20)\xFE//  { \"lngX\": -115.703201293945, \"latY\": 44.6664553391477 }\xFE//\xFEfunction leaflet_tile2LatLng(Byval Tile_x As Integer, Byval Tile_y As Integer, Byval Zoom As Integer) As Json\xFE    *$options async-\xFE    \xFE    Dim N As Single = Pi() - ((2.0 * Pi() * Tile_y) / Pwr(2.0, Zoom));\xFE    Dim lngX As Single = (Tile_x / Pwr(2.0, Zoom) * 360.0) - 180.0;\xFE    Dim latY As Single = 180.0 / Pi() * ATan(SinH(N))\xFE\xFE    Dim A As Json = {a:[latY, lngX]}\xFE    Return A.a\xFEEnd function";
