var z="function MsgBox(ByVal Title As String, optional byval Message As String, optional ByVal CSVAnswers As Variant, optional byval width As String, optional byval height As String) As String\xFE";
 z+="* $options aspxc-\xFE";
 z+="\xFE";
 z+="*\xFE";
 z+="* Create Dialog\xFE";
 z+="*\xFE";
 z+="    Dim DC As Integer\xFE";
 z+="    Dim I As Integer\xFE";
 z+="    Dim MSG As String\xFE";
 z+="    Dim INNERHTMLDIALOG As String\xFE";
 z+="    Dim TXT As String\xFE";
 z+="    Dim DEFAULTANS As String\xFE";
 z+="\xFE";
 z+="    if isMissing(Message) Then\xFE";
 z+="        Message = Title\xFE";
 z+="        Title = \"Message\"\xFE";
 z+="        CSVAnswers = \"OK\"\xFE";
 z+="        \xFE";
 z+="    elseIf isMissing(CSVAnswers) then\xFE";
 z+="        CSVAnswers = Message\xFE";
 z+="        Message = Title\xFE";
 z+="        Title = \"Message\"\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    if TypeOf(CSVAnswers) = \"Array\" Then CSVAnswers = Join(CSVAnswers, \",\")\xFE";
 z+="    \xFE";
 z+="    if InStr(Message, chr(28)) And Count(Message, Chr(28)) = Count(Message, Chr(29)) Then\xFE";
 z+="        Msg = Message\xFE";
 z+="    Else\xFE";
 z+="        Msg = Replace(Message, CRLF(), AM())\xFE";
 z+="        Msg = Replace(Msg, AM(), \"**AM**\")\xFE";
 z+="        Msg = Replace(Msg, Chr(28):\"<\", \"**LT**\")\xFE";
 z+="        Msg = Replace(Msg, \">\":Chr(29), \"**GT**\")\xFE";
 z+="        Msg = @jsb_bf.HtmlEncode(Msg)\xFE";
 z+="        Msg = Replace(Msg, \"**AM**\", \"<br />\")\xFE";
 z+="        Msg = Replace(Msg, \"**LT**\", \"<\")\xFE";
 z+="        Msg = Replace(Msg, \"**GT**\", \">\")\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    defaultAns = \"\"\xFE";
 z+="    \xFE";
 z+="    innerHtmlDialog = Chr(28):`<span class='msgbox'>`:Msg:`<br /></span><hr>`\xFE";
 z+="    DC = DCount(CSVAnswers, \",\")\xFE";
 z+="    For I = 1 To DC\xFE";
 z+="        Txt = Field(CSVAnswers, \",\", I)\xFE";
 z+="        innerHtmlDialog := `<button type=\"button\" class='SubmitBtn'`\xFE";
 z+="        \xFE";
 z+="        if left(txt, 1) = \"*\" Or DC = 1 then \xFE";
 z+="            if left(txt, 1) = \"*\" then txt = mid(txt, 2)\xFE";
 z+="            defaultAns = txt\xFE";
 z+="            innerHtmlDialog := ` id='defaultAns'`\xFE";
 z+="        end if\xFE";
 z+="        \xFE";
 z+="        innerHtmlDialog := ` onclick=`:jsEscapeAttr(`storeVal('msgboxResult', `:@jsEscapeString(Txt):`); $('#dialog').dialog('close');`)\xFE";
 z+="        innerHtmlDialog := `>`:@jsb_bf.HtmlEncode(@jsb_bf.Language(Txt)):`</button>&nbsp;`\xFE";
 z+="    Next\xFE";
 z+="    \xFE";
 z+="    if defaultAns then\xFE";
 z+="        innerHtmlDialog := @Script(`\xFE";
 z+="            $( document ).ready(function() {\xFE";
 z+="                setTimeout(function(){ $('#defaultAns').focus() }, 50);\xFE";
 z+="            });\xFE";
 z+="        `)\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    innerHtmlDialog := Chr(29)\xFE";
 z+="    Return @jsb_bf.Dialog(Title, innerHtmlDialog, true, width, height)\xFE";
 z+="end function"
