window.cached_jsb_bf["msgboxfwd"]="function MsgBoxFwd(ByVal Title As String, ByVal Message As String, ByVal CSVAnswers As String, optional ByVal responseUrl As String, optional byval width As String, optional byval height As String) As String\xFE    If isMissing(CSVAnswers) then\xFE        responseUrl = CsvAnswers\xFE        CSVAnswers = Message\xFE        Message = Title\xFE        Title = \"Message\"\xFE    end if\xFE    \xFE    Dim S As String = `MsgBox(`:jsEscapeString(Title):`, `:jsEscapeString(Message):`, `:jsEscapeString(CSVAnswers):`, 'auto', 'auto', function (ans) {\xFE             var url = `:jsEscapeString(responseUrl):`;\xFE             if (InStr(url, '?')) url += '&'; else url += '?';\xFE             url += 'ans=' + ans;\xFE             windowOpen(url)\xFE            })`\xFE    Print @(-1):@Script(S):\xFE    Stop\xFEend function\xFE\xFE";
var z="* Returns NULL and @Errors, or a valid GPS { lat: xxxx, lng: xxxx }\xFE";
 z+="Function myGPS As String\xFE";
 z+="* $options aspx, gae, aspxc-\xFE";
 z+="    Dim W As Json\xFE";
 z+="    Dim HTML As String\xFE";
 z+="    Dim B As String\xFE";
 z+="    Dim F_GPS As String\xFE";
 z+="\xFE";
 z+="    if Left(Url(), 5) <> \"https\" Then @Errors = \"A secure URL is required for GPS location\"; Return null\xFE";
 z+="    Html = Chr(28):`\xFE";
 z+="         <input id=\"f_GPS\" name=\"f_GPS\" type=\"hidden\"></input>\xFE";
 z+="         <script type='text/javascript'>\xFE";
 z+="            window.returnMyGPS = function (dontAsk) {\xFE";
 z+="               if (navigator.geolocation) {\xFE";
 z+="                    // Stop serverFlush from happening\xFE";
 z+="                    navigator.geolocation.getCurrentPosition(function(position) {\xFE";
 z+="                      $('#f_GPS').val(\"{lng:\" + position.coords.longitude + \", lat:\" + position.coords.latitude + \"}\")\xFE";
 z+="                      $('#jsb').attr(\"id\",\"jsbhide\"); $('#jsbhide').submit();\xFE";
 z+="                      \xFE";
 z+="                    }, function(error) {\xFE";
 z+="                        switch(error.code) {\xFE";
 z+="                            case error.PERMISSION_DENIED:\xFE";
 z+="                               $('#f_GPS').val(\"{ error: 'User denied the request for Geolocation.' }\")\xFE";
 z+="                               break\xFE";
 z+="\xFE";
 z+="                            case error.POSITION_UNAVAILABLE:\xFE";
 z+="                               $('#f_GPS').val(\"{ error: 'Location information is unavailable.' }\")\xFE";
 z+="                              break\xFE";
 z+="\xFE";
 z+="                            case error.TIMEOUT:\xFE";
 z+="                               if (dontAsk || !screen.availLeft) {\xFE";
 z+="                                   $('#f_GPS').val(\"{ error: 'Location Timeout.' }\");\xFE";
 z+="                                   break;\xFE";
 z+="                               }\xFE";
 z+="                               alert('Chrome is asking you a question, move your browser window to see it');\xFE";
 z+="                               return returnMyGPS(true)\xFE";
 z+="                               \xFE";
 z+="                            default:\xFE";
 z+="                               $('#f_GPS').val(\"{ error: 'Geolocation error' }\")\xFE";
 z+="                        }\xFE";
 z+="                            \xFE";
 z+="                        $('#jsb').attr(\"id\",\"jsbhide\"); $('#jsbhide').submit();\xFE";
 z+="                    }, {timeout:10000});\xFE";
 z+="                } else {\xFE";
 z+="                     $('#f_GPS').val(\"{ error: 'Your browser doesn't support Geolocation' }\")\xFE";
 z+="                     $('#jsb').attr(\"id\",\"jsbhide\"); $('#jsbhide').submit();\xFE";
 z+="                }\xFE";
 z+="            }\xFE";
 z+="            \xFE";
