 z+="         </script>\xFE";
 z+="         `:Chr(29)\xFE";
 z+="    B = @Response.buffer()\xFE";
 z+="    Print Html:\xFE";
 z+="    @Server.flush\xFE";
 z+="    \xFE";
 z+="    f_GPS = @Jsb_bf.formvar('f_GPS')\xFE";
 z+="    @Response.buffer(B)\xFE";
 z+="    \xFE";
 z+="    W = CJson(f_GPS)\xFE";
 z+="    if !W Then @Errors = \"Unknown error: \":f_GPS; return null\xFE";
 z+="    if W.error then @Errors = W.error; return null\xFE";
 z+="    \xFE";
 z+="    Return W\xFE";
 z+="End Function\xFE";
 z+="\xFE";
 z+="* Returns NULL and @Errors, or a valid GPS { lat: xxxx, lng: xxxx }\xFE";
 z+="*   see also BF CORDOVA's background: Print @startGPS, @readGPS, @stopGPS\xFE";
 z+="*\xFE";
 z+="Function myGPS As String\xFE";
 z+="    * $options js, aspxc-\xFE";
 z+="    * $options internal permissions\xFE";
 z+="    Pos = {}\xFE";
 z+="    if Left(Url(), 5) <> \"https\" and !isPhoneGap() Then @Errors = \"A secure URL is required for GPS location\"; Return null\xFE";
 z+="    if !window.navigator.geolocation then @Errors = \"Your browser doesn't have Geolocation\"; Return null\xFE";
 z+="\xFE";
 z+="    // See https://www.npmjs.com/package/cordova-plugin-android-permissions\xFE";
