 z+="\xFE";
 z+="        Until Instr(\" =><\", C) > 1 Or Instr(\" =><\", Nc) > 1 Or C = \"\" Or Instr(Lcname, \"[\") Or Instr(Lcname, \"]\") Or Lcname = \"like\" Or LCase(Nc) = \"like\" Or Lcname = \"with\" Or Lcname = \"where\" Or Lcname = \"order\" Or Lcname = \"orderby\" Or Lcname = \"by\" Do\xFE";
 z+="            If Left(Cname, 1) = \"'\" And Right(Cname, 1) = \"'\" Then\xFE";
