var z="function ParseSelect_Expr(Fd_file As FileHandle, Tokens As Array, Operators As VARIANT, lastOperator As String) As String\xFE";
 z+="    * $options aspxc-\xFE";
 z+="    * $options internal tokens\xFE";
 z+="    Dim HADQUOTES As Boolean\xFE";
 z+="    Dim TK As String\xFE";
 z+="    Dim GSTART As StRiNg\xFE";
 z+="    Dim GEND As String\xFE";
 z+="    Dim EXPRS As String\xFE";
 z+="    Dim EXPR As String\xFE";
 z+="    Dim LR As String\xFE";
 z+="    Dim ATRREC As String\xFE";
 z+="    Dim LE As String\xFE";
 z+="    Dim E As String\xFE";
 z+="    Dim CONV As String\xFE";
 z+="\xFE";
 z+="    Tk = LCase(Tokens[1])\xFE";
 z+="    lastOperator = ''\xFE";
 z+="\xFE";
 z+="    If Tk = \"(\" Or Tk = \"[\" Then\xFE";
 z+="        * Grouping\xFE";
 z+="        GStart = Tk\xFE";
 z+="        If GStart = \"(\" Then GEnd = \")\" Else GEnd = \"]\"\xFE";
 z+="        \xFE";
 z+="        Exprs = \"(\"\xFE";
 z+="        Tokens.Delete(1)\xFE";
 z+="\xFE";
 z+="        Loop\xFE";
 z+="            Expr = ParseSelect_Term(Tokens, Operators)\xFE";
 z+="            Exprs := Expr\xFE";
 z+="        While Tokens[1] = \",\" Do\xFE";
 z+="            Tokens.Delete(1)\xFE";
 z+="            Exprs := \", \"\xFE";
 z+="        Repeat\xFE";
 z+="        \xFE";
 z+="        Tk = LCase(Tokens[1])\xFE";
 z+="        \xFE";
 z+="        Exprs := \")\"; lastOperator = GEnd\xFE";
 z+="        If Tk <> \")\" And Tk <> GEnd Then Stop \"missing \":GEnd\xFE";
 z+="        Tokens.Delete(1)\xFE";
 z+="\xFE";
 z+="    ElseIf Right(Tk, 1) = \"(\" Then\xFE";
 z+="        * function?\xFE";
 z+="        Exprs = Tk\xFE";
 z+="        Tokens.Delete(1)\xFE";
 z+="\xFE";
 z+="        Loop\xFE";
 z+="            E = ParseSelect_Expr(Fd_file, Tokens, Operators, \"\")\xFE";
 z+="            If E Then Exprs := E\xFE";
 z+="            Tk = LCase(Tokens[1])\xFE";
 z+="        While Tk = \",\" Do\xFE";
 z+="            Exprs := \", \"\xFE";
 z+="            Tokens.Delete(1)\xFE";
 z+="        Repeat\xFE";
 z+="\xFE";
 z+="        Exprs := \")\"; lastOperator = \")\"\xFE";
 z+="        If Tk <> \")\" Then Stop \"missing )\"\xFE";
 z+="        Tokens.Delete(1)\xFE";
 z+="\xFE";
 z+="    Else\xFE";
 z+="        Exprs = ParseSelect_Term(Tokens, Operators)\xFE";
 z+="        If Exprs = \"\" Then Return \"\"\xFE";
 z+="        \xFE";
 z+="        // Make srue column names are using \"\xFE";
 z+="        if Left(Exprs, 1) = \"'\" And Right(Exprs, 1) = \"'\" Then Exprs = '\"':Replace(Mid(Exprs, 2, len(Exprs)-2), '\"', `\\\"`):'\"'\xFE";
 z+="        \xFE";
 z+="        // Is this a columnName?  And if so, do we need to check for an input conversion?\xFE";
 z+="        Conv = Null\xFE";
 z+="        Lr = \"L\"\xFE";
 z+="        If Fd_file Then\xFE";
 z+="            Read atrRec From Fd_file, Exprs Then\xFE";
 z+="                If Instr(\"asAS\", atrRec<1>) Then\xFE";
 z+="                    If IsNum(atrRec<2>) Then Exprs = \"*A\":atrRec<2>\xFE";
 z+="                    Conv = atrRec<8>\xFE";
 z+="                    Lr = UCase(atrRec<9>)\xFE";
 z+="                Else\xFE";
 z+="                    Conv = Null\xFE";
 z+="                End If\xFE";
 z+="            Endif\xFE";
 z+="        End If\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    Loop\xFE";
 z+="        Tk = LCase(Tokens[1])\xFE";
 z+="        If Tk = 'not' And LCase(Tokens[2]) = 'like' Then\xFE";
 z+="            Tokens.Delete(1)\xFE";
 z+="            Tk = \"not like\"\xFE";
 z+="        Else\xFE";
 z+="            Locate Tk In Operators Else Break\xFE";
 z+="        End If\xFE";
 z+="\xFE";
 z+="    While Tk <> \"\" Do\xFE";
 z+="        If Tk = \"!=\" Or Tk = \"#\" Then Tk = \"<>\"\xFE";
 z+="        lastOperator = Tk\xFE";
 z+="        Tokens.Delete(1)\xFE";
 z+="        E = ParseSelect_Expr(Fd_file, Tokens, Operators, \"\")\xFE";
 z+="        If E = \"\" Then Stop 'missing term'\xFE";
