 z+="            E = \"''\"\xFE";
 z+="            \xFE";
 z+="        ElseIf Le = 'false' Or Le = 'true' Or Le = 'null' Then\xFE";
 z+="            E = LCase(E)\xFE";
 z+="            \xFE";
 z+="        Else If IsNum(E) And !hadQuotes Then\xFE";
 z+="            E = E\xFE";
 z+="            \xFE";
 z+="        ElseIf lastOperator = \"in\" And (Left(Le, 1) = \"(\" Or Left(Le, 1) = \"[\") Then\xFE";
