 z+="            E = \"'\":E:\"'\"\xFE";
 z+="\xFE";
 z+="            E = Replace(E, \"[\", \"%\")\xFE";
 z+="            E = Replace(E, \"]\", \"%\")\xFE";
 z+="            \xFE";
