var z="// Attempt to see if the primary key can be determined from the json records\xFE";
 z+="function PrimaryKeyNameFromJSON(Byval fHandle As Object) As String\xFE";
 z+="    Dim NotJSon As Array = []\xFE";
 z+="    Dim NotPK As Array = []\xFE";
