 z+="        tblName = Fhandle\xFE";
 z+="        Fhandle = @Fhandle(Fhandle)\xFE";
 z+="        if !Fhandle Then Return Nothing\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Dim SL As SelectList\xFE";
 z+="    Select \"Top 50\" From Fhandle To Sl Else Return Nothing\xFE";
 z+="\xFE";
 z+="    Dim ItemIDs As Array = Getlist(Sl)\xFE";
 z+="    Dim RecI As Integer\xFE";
 z+="    Dim ItemId As String\xFE";
 z+="    For Each ItemId, RecI In ItemIDs\xFE";
 z+="        Dim JREC As Json\xFE";
