var z="function quickSortCmp(byval a As String, byval b As String, byval tagProperties As String, byval reverse As String) As Boolean\xFE";
 z+="*$options gae\xFE";
 z+="\xFE";
 z+="    Dim TL As Integer\xFE";
 z+="    Dim TP As Json\xFE";
 z+="    Dim DIR As String\xFE";
 z+="    Dim TAG As StRiNg\xFE";
 z+="    Dim AV As StriNg\xFE";
 z+="    Dim BV As StriNg\xFE";
 z+="\xFE";
 z+="    for each tag in tagProperties\xFE";
 z+="        tp = tagProperties[tag]\xFE";
 z+="\xFE";
 z+="        av = a[tag]\xFE";
 z+="        if (!av) then av = nothing;\xFE";
 z+="        bv = b[tag];\xFE";
 z+="        if (!bv) then bv = nothing;\xFE";
 z+="\xFE";
 z+="        if (tp.numerical) { \xFE";
 z+="            av = CNum(av); \xFE";
 z+="            bv = CNum(bv); \xFE";
 z+="\xFE";
 z+="        } else if (!IsNum(av) || !IsNum(bv)) {\xFE";
 z+="            if (typeof(av) <> 'String') then av = CStr(av);\xFE";
 z+="            if (typeof(bv) <> 'String') then bv = CStr(bv);\xFE";
 z+="\xFE";
 z+="            if tp.ignorecase {\xFE";
 z+="                av = LCase(av)\xFE";
 z+="                bv = LCase(bv)\xFE";
 z+="            }\xFE";
 z+="        }\xFE";
 z+="\xFE";
 z+="        if (tp.right) {\xFE";
 z+="            if len(av) > len(bv) then tl = len(av) else tl = len(bv)\xFE";
 z+="            av = Space(tl - len(av)) + av;\xFE";
 z+="            bv = Space(tl - len(bv)) + bv;\xFE";
 z+="        }\xFE";
 z+="\xFE";
 z+="        dir = reverse;\xFE";
 z+="        if (tp.descending) then dir = !dir;\xFE";
 z+="\xFE";
 z+="        if (dir) {\xFE";
 z+="            if (av < bv) then return true;\xFE";
 z+="            if (av > bv) then return false;\xFE";
 z+="        } else {\xFE";
 z+="            if (av > bv) then return true;\xFE";
 z+="            if (av < bv) then return false;\xFE";
 z+="        }\xFE";
 z+="    next\xFE";
 z+="    return true\xFE";
 z+="end function"
