var z="* Call a restful url with:\xFE";
 z+="*   Success = @Rpc(@rootAccount, \"\", \"serverSendEmail\", From, To, CC, BCC, Subject, Body, Errs)\xFE";
 z+="*   - note: all returned data is placed in @Errors (useful if the return result is not JSON)\xFE";
 z+="*\xFE";
 z+="*\xFE";
 z+="* Make your own Restful functions with either an RPC call definition (@@routine)(Dim parameters), as in:\xFE";
 z+="*   function @@routine(p1, p2, p3...)\xFE";
 z+="*      return anything\xFE";
 z+="*   end function\xFE";
 z+="*\xFE";
 z+="* or a restful server function (parameters are ByVal)\xFE";
 z+="*\xFE";
 z+="*   restful function routine(p1, p2, p3...)\xFE";
 z+="*      return { Ans = rpc_: 1 } ;* must return a json structure\xFE";
 z+="*   end function\xFE";
 z+="*\xFE";
 z+="\xFE";
 z+="\xFE";
 z+="function rpc(byval serveraccount As String, ByVal sid As String, ByVal command As String, optional p1 As String, optional p2 As String, optional p3 As String, optional p4 As String, optional p5 As String, optional p6 As String, optional p7 As String) As Object\xFE";
 z+="    Dim JsonResult As Json\xFE";
 z+="    Dim Body As String\xFE";
 z+="\xFE";
 z+="    serveraccount = LCase(serveraccount)\xFE";
 z+="    if right(serveraccount, 1) <> \"/\" then serveraccount := \"/\"\xFE";
 z+="    if !IsMissing(p1) Then Body = '_p1=':@UrlEncode(p1)\xFE";
 z+="    if !IsMissing(p2) Then Body := '&_p2=':@UrlEncode(p2)\xFE";
 z+="    if !IsMissing(p3) Then Body := '&_p3=':@UrlEncode(p3)\xFE";
 z+="    if !IsMissing(p4) Then Body := '&_p4=':@UrlEncode(p4)\xFE";
 z+="    if !IsMissing(p5) Then Body := '&_p5=':@UrlEncode(p5)\xFE";
 z+="    if !IsMissing(p6) Then Body := '&_p6=':@UrlEncode(p6)\xFE";
 z+="    if !IsMissing(p7) Then Body := '&_p7=':@UrlEncode(p7)\xFE";
 z+="    Body := '&_rpcsid_=':sid \xFE";
 z+="\xFE";
 z+="    for retry = 1 to 99\xFE";
 z+="        @Errors = \"\"\xFE";
 z+="        Dim stringResult As String\xFE";
 z+="        \xFE";
 z+="        If InStr(lcase(command), \"write\")  Or Len(Body) > 600 Then // Or InStr(lcase(command), \"login\")\xFE";
 z+="            //  Get(Url, method , header, body, opts)\xFE";
 z+="            stringResult = @Get(serveraccount:command, \"POST\", Nothing, Body:'&_cachebuster=':@NewGuid, Nothing)\xFE";
 z+="        Else\xFE";
 z+="            stringResult = @Get(serveraccount:command:\"?\":Body:'&_cachebuster=':@NewGuid, \"GET\", Nothing, Nothing, Nothing)\xFE";
 z+="        End if\xFE";
 z+="    \xFE";
 z+="        Dim Ans As Variable = rpc_assertJSON(serveraccount:command, stringResult, JsonResult) \xFE";
 z+="        If !Ans Then Return 0\xFE";
 z+="        \xFE";
 z+="        If Ans <> -1 Then break\xFE";
 z+="    next\xFE";
 z+="  \xFE";
 z+="    if !IsMissing(JsonResult._p1) Then p1 = JsonResult._p1\xFE";
 z+="    if !IsMissing(JsonResult._p2) Then p2 = JsonResult._p2\xFE";
 z+="    if !IsMissing(JsonResult._p3) Then p3 = JsonResult._p3\xFE";
 z+="    if !IsMissing(JsonResult._p4) Then p4 = JsonResult._p4\xFE";
 z+="    if !IsMissing(JsonResult._p5) Then p5 = JsonResult._p5\xFE";
 z+="    if !IsMissing(JsonResult._p6) Then p6 = JsonResult._p6\xFE";
 z+="    if !IsMissing(JsonResult._p7) Then p7 = JsonResult._p7\xFE";
 z+="    \xFE";
 z+="    dim rpcSid As String = JsonResult._rpcsid_\xFE";
