var z="// Returns 1 if JSON, 0 if not, -1 if you should retry\xFE";
 z+="function rpc_assertJSON(url As String, stringResult As String, JsonResult As JSON) As Integer\xFE";
 z+="    if Left(stringResult, 2) = \"0x\" Then stringResult = XTS(Mid(stringResult, 3))\xFE";
 z+="    @Session.lastGetHeader = @Errors ;* GET returns header here - move it\xFE";
 z+="    @Session.lastGet_rpcsid_ = \"\"\xFE";
 z+="    \xFE";
 z+="    If left(stringResult, 1) <> '{' Then\xFE";
 z+="       if @Errors = \"\" Or InStr(@Errors, \"200:OK\") Then\xFE";
 z+="           if InStr(stringResult, \"<form\") Then\xFE";
 z+="               stringResult = Field(Field(stringResult, \"<form\", 2), \"</form\", 1)\xFE";
