 z+="               stringResult = DropIfRight(stringResult, `<style>#jsb`)\xFE";
 z+="               stringResult = DropIfRight(stringResult, `<style>#jsb`)\xFE";
 z+="               stringResult = Replace(stringResult, `<br/>`, Crlf())\xFE";
 z+="               stringResult = Replace(stringResult, `<br />`, Crlf())\xFE";
 z+="               stringResult = Replace(stringResult, `<br>`, Crlf())\xFE";
 z+="               @Errors = \"I expected JSON data and I received HTML data. Result: \":CRLF():stringResult\xFE";
 z+="           Else\xFE";
 z+="               @Errors = \"I expected JSON data and I received text. Result: \":CRLF():stringResult\xFE";
 z+="           End If\xFE";
 z+="       End If\xFE";
 z+="       \xFE";
 z+="       if @isAspxC Then Return 0\xFE";
 z+="       \xFE";
 z+="       Dim Msg As String\xFE";
 z+="       if @IsAdmin Then Msg = \"*Retry,Fail,Debug\" Else Msg = \"*Retry,Fail\"\xFE";
 z+="       Dim Ans As String = Msgbox(\"AJAX Error\", \"Remote Server Error From \":url:CRLF():CRLF():@Errors, Msg) \xFE";
 z+="       If Ans = \"Retry\" Then Return 0-1\xFE";
 z+="       If Ans = \"Debug\" Then Debug; Return 0-1\xFE";
 z+="       return 0\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Try\xFE";
 z+="        JsonResult = JSON(stringResult)\xFE";
