 z+="        if @isAspxC Then Return 0\xFE";
 z+="        \xFE";
 z+="        if Msgbox(\"AJAX Error\", @Errors, \"Retry,Fail\") = \"Retry\" Then Return 0-1\xFE";
 z+="        return 0\xFE";
 z+="    End Try\xFE";
 z+="    \xFE";
 z+="    @Session.lastGet_rpcsid_ = JsonResult._rpcsid_\xFE";
 z+="\xFE";
 z+="    if IsNothing(JsonResult._restFunctionResult) Then\xFE";
 z+="       @Errors = \"Unexpected json result from \":url:CRLF():\"I expected a TAG '_restFunctionResult' and I received \":CRLF():CRLF():JsonResult\xFE";
 z+="       return 0\xFE";
 z+="    end if\xFE";
 z+="    \xFE";
 z+="    return 1\xFE";
 z+="end function"
