 z+="function SortArrayOfString(byval UnsortedArray As String, byval sortTags As String) As Array\xFE";
 z+="*$options gae, js, async-\xFE";
 z+="    Dim SORTED As Array\xFE";
 z+="    Dim NUMERICSORT As Boolean\xFE";
 z+="    Dim IGNORECASE As Boolean\xFE";
 z+="    Dim DESCENDING As Boolean\xFE";
 z+="    Dim RIGHTALIGN As Boolean\xFE";
 z+="    Dim ALLNUMERIC As Boolean\xFE";
 z+="    Dim APPENDIT As Boolean\xFE";
 z+="    Dim TL As Integer\xFE";
 z+="    Dim I As Integer\xFE";
 z+="    Dim ITEM As String\xFE";
 z+="    Dim H As StRiNg\xFE";
 z+="    Dim SI As StriNg\xFE";
 z+="    Dim CI As StriNg\xFE";
 z+="\xFE";
 z+="    NumericSort = InStr(sortTags, \"#\") Or InStr(sortTags, \"N\")\xFE";
 z+="    ignoreCase = InStr(sortTags, \"~\") Or InStr(sortTags, \"I\")\xFE";
 z+="    Descending = InStr(sortTags, \"<\") Or InStr(sortTags, \"D\")\xFE";
 z+="    RightAlign = InStr(sortTags, \"!\") Or InStr(sortTags, \"R\")\xFE";
 z+="\xFE";
 z+="    Sorted = []\xFE";
 z+="    if !NumericSort Then\xFE";
 z+="        AllNumeric = True\xFE";
 z+="        for each Item in UnsortedArray\xFE";
 z+="            if !IsNumeric(Item) Then \xFE";
 z+="                AllNumeric = False\xFE";
 z+="                Break\xFE";
 z+="            end if\xFE";
 z+="        next\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    for each Item in UnsortedArray\xFE";
 z+="        AppendIt = True\xFE";
 z+="        For I = 1 to UBound(Sorted)\xFE";
 z+="            SI = Sorted[I]\xFE";
 z+="            CI = Item\xFE";
 z+="\xFE";
 z+="            If NumericSort Then\xFE";
 z+="                SI = CNum(SI)\xFE";
 z+="                CI = CNum(CI)\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If ignoreCase Then\xFE";
 z+="                SI = LCase(SI)\xFE";
 z+="                CI = LCase(CI)\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If RightAlign Then\xFE";
 z+="                If Len(SI) > Len(CI) Then TL = Len(SI) Else TL = Len(CI)\xFE";
 z+="                SI = Space(TL - Len(SI)) : SI\xFE";
 z+="                CI = Space(TL - Len(CI)) : CI\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If Descending then\xFE";
 z+="                H = SI\xFE";
 z+="                SI = CI\xFE";
 z+="                CI = H\xFE";
 z+="            End If\xFE";
 z+="\xFE";
 z+="            If SI > CI Then\xFE";
 z+="                Sorted.Insert(I, Item)\xFE";
 z+="                AppendIt = False\xFE";
 z+="                Break\xFE";
 z+="            End If\xFE";
 z+="        Next\xFE";
 z+="\xFE";
 z+="        If AppendIt = True Then Sorted[-1] = Item\xFE";
 z+="    Next \xFE";
 z+="    \xFE";
 z+="    Return Sorted\xFE";
 z+="end function"
