 z+="//\xFE";
 z+="//  Returns then long name (prefix and Suffix) - which is the actual filename that was written to the fileStorageDirectory\xFE";
 z+="//               shortname return as a parameter\xFE";
 z+="//\xFE";
 z+="function unload_UploadBox(ByVal Id As String, Byval fileStorageDirectory As String, ByVal RegisterInSystem As Boolean, ByVal Prefix As String, ByVal FileNameSuffix As String, ByRef shortName As String) As String\xFE";
 z+="*$options S-\xFE";
