 z+="    Dim httpPostedFile As Object = @Request.Files(Id)\xFE";
 z+="    If !httpPostedFile Then Return Nothing\xFE";
 z+="    \xFE";
 z+="    Dim actualName As String = httpPostedFile.FileName\xFE";
 z+="    If !actualName Then Return Nothing\xFE";
 z+="    \xFE";
 z+="    // Get contents\xFE";
 z+="    Dim uploadedFileContents As String = @RequestFile(Id)\xFE";
 z+="    Dim shortName As String = Prefix:actualName\xFE";
 z+="\xFE";
