 z+="            Return Nothing\xFE";
 z+="        End If\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Write uploadedFileContents On fHandle(\"\", fileStorageDirectory, True), longName Else Return Nothing\xFE";
