 z+="        Write priorSystemDef On fHandle('system'), \"x\":longName Else Alert(@Errors)\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    // Path will be embedded in a Data Source string, so use \\\\ as a seperator\xFE";
