 z+="        Path = `<<root>>\\\\uploads\\\\`\xFE";
 z+="    ElseIf fileStorageDirectory = \"database\" Then\xFE";
 z+="        Path = `<<root>>\\\\App_Data\\\\_database\\\\`\xFE";
 z+="    Else\xFE";
 z+="        Path = `<<root>>\\\\App_Data\\\\_database\\\\`:fileStorageDirectory:`\\\\`\xFE";
 z+="    End If\xFE";
 z+="\xFE";
 z+="    Dim DS As String\xFE";
 z+="    If Ext = \"accdb\" Then\xFE";
 z+="       DS = 'Provider=Microsoft.ACE.OLEDB.12.0;Data Source=\"':Path:longName:'\";Persist Security Info=False'\xFE";
 z+="    ElseIf Ext = \"xlsx\" Then\xFE";
