var z="function VerifyUser(ByRef UserName As String, Byval Password As String) As Boolean\xFE";
 z+="    Dim SUCCESS As Boolean\xFE";
 z+="    Dim F_USERS As FileHandle\xFE";
 z+="    Dim CONFIG As Json\xFE";
 z+="    Dim PROFILE As Json\xFE";
 z+="    Dim AUTHTYPE As String\xFE";
 z+="    Dim EMDOMAIN As String\xFE";
 z+="    Dim oAuthAuthority As String\xFE";
