 z+="        Config = jsbConfig('authenticationtype')\xFE";
 z+="        If !Config Then \xFE";
 z+="            Config = {}\xFE";
 z+="            authType = \"local\"\xFE";
 z+="        end else \xFE";
 z+="            authType = Config.value\xFE";
 z+="        end if\xFE";
 z+="    End If\xFE";
 z+="    \xFE";
 z+="    Success = False\xFE";
 z+="\xFE";
 z+="    Select Case authType\xFE";
 z+="        Case \"none\"\xFE";
 z+="            Return True\xFE";
 z+="\xFE";
 z+="        Case \"aspx\"\xFE";
 z+="            try\xFE";
 z+="                If @Membership.ValidateUser(UserName, Password) Then Success = True\xFE";
 z+="            End Try\xFE";
 z+="            \xFE";
 z+="        Case \"oauth\"\xFE";
 z+="            oAuthAuthority = Config.oauth_authority\xFE";
 z+="            oAuthAuthority = dropIfRight(oAuthAuthority, \"_config\")\xFE";
 z+="            \xFE";
 z+="            If oAuthAuthority Then\xFE";
 z+="                If @Jsb_odb.oauth_Login(oAuthAuthority, False) Then\xFE";
 z+="                    Success = True\xFE";
 z+="                    Userinfo = @jsb_odb.oAuthWho()\xFE";
 z+="                    If Userinfo Then\xFE";
 z+="                        If Userinfo.username And (UserName = \"\"  Or LCase(UserName) = LCase(Userinfo.username)) Then\xFE";
 z+="                            UserName = Userinfo.username\xFE";
 z+="                            If LCase(Left(UserName, Len(oAuthAuthority))) <> LCase(oAuthAuthority) Then UserName = oAuthAuthority:\"-\":UserName\xFE";
 z+="                            \xFE";
 z+="                            I_Open \"JSB_USERS\" To F_users Else return True\xFE";
 z+="                            I_ReadJSon Profile From F_users, UserName Else\xFE";
 z+="                                Profile = {}\xFE";
 z+="                                Profile.username = UserName\xFE";
 z+="                                Profile.password = \"X\"\xFE";
 z+="                                Profile.isinrole = []\xFE";
 z+="                                Profile.disabled = False\xFE";
 z+="                                \xFE";
 z+="                                If Userinfo.email Then\xFE";
 z+="                                    Profile.email = Userinfo.email\xFE";
 z+="                                    Emdomain = LCase(Dropleft(Userinfo.email, \"@\"))\xFE";
 z+="                                    If Left(Emdomain, Len(oAuthAuthority) + 1) = oAuthAuthority:\".\" Then Profile.isinrole = [\"employee\"]\xFE";
 z+="                                End If\xFE";
 z+="                                \xFE";
 z+="                                I_WriteJson Profile On F_users, UserName Else Null\xFE";
 z+="                            End If\xFE";
 z+="                        End If\xFE";
 z+="                    End If\xFE";
 z+="                End If\xFE";
 z+="            End If\xFE";
 z+="            \xFE";
 z+="        Case \"gae\"\xFE";
 z+="            \xFE";
 z+="        Case \"server\"\xFE";
 z+="            If System(1) = \"js\" And UserName <> \"\" Then\xFE";
 z+="                If @@ServerVerifyUser(UserName, Password) Then Success = True\xFE";
 z+="            End If\xFE";
 z+="    End Select\xFE";
 z+="    \xFE";
 z+="    If !Success And System(1) = \"aspx\" Then Success = @isLocalHost\xFE";
 z+="    \xFE";
 z+="    I_Open \"JSB_USERS\" To F_users Else return Success\xFE";
 z+="    I_ReadJSon Profile From F_users, UserName Else Return Success\xFE";
 z+="    \xFE";
 z+="    If Profile.errorcount > 15 Or Profile.disabled Then \xFE";
 z+="        Profile.disabled = true\xFE";
 z+="    Else\xFE";
 z+="        If !Success Then\xFE";
 z+="            If !Profile.password Then\xFE";
 z+="                If System(1) = \"js\" Then\xFE";
 z+="                    Success = True\xFE";
 z+="                Else\xFE";
 z+="                    Locate \"admin\" In Profile.isinrole Then Success = False Else Success = True\xFE";
 z+="                End If\xFE";
 z+="                \xFE";
 z+="            ElseIf Profile.password = \"X\" Then\xFE";
 z+="                Success = False // login only by Membership or oAuth\xFE";
 z+="                \xFE";
 z+="            ElseIf Left(Profile.password, 1) = Chr(252) Then\xFE";
